o vaše osobní doklady či cenné věci a pro kabely a napájecí zdroj je uzpůsobena přední kapsa. BacPac Mission má také speciální nepromokavou kapsu pro přehrávač. Batoh je vyroben z nepromokavého a pevného materiálu, který dobře ochání vaše vybavení proti nepřízni počasí.&lt;BR&gt;  BacPac Mission je vyroben pro větší pohodlí a bezpečnost. Pohodlí zajišťují speciálně tvarované ramenní popruhy, polstrování zadní části a úchyty na zipech z kvalitního syntetického materiálu. Bezpečnost pak zajistí odrazová deska na přední části, která je dobře viditelná v mlze anebo ve tmě.&lt;BR&gt;  BacPac Mission je vyroben v různých barvách: modrá, červená, oranžová, zelená a černá!&lt;BR&gt;&lt;BR&gt;    Vybavení:&lt;BR&gt;  Pohodlný batoh na notebook; moderní a sportovní vzhled; módní doplňky: pryžový povrch, výrazné úchyty na zipech, karabina; polstrováná část pro notebook; pásek na uchycení k notebooku; prostor pro dokumenty; plocha s kapsami pro drobné&lt;BR&gt;&lt;BR&gt;","false","0","","-1","-1","true","","-1","-1","true","30","Rok(ů)","","0001-01-01T00:00:00","1775.00","KS","8.00","8","2018-05-15T15:56:32.65","DIC","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_125\/125092_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_125\/125092_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_125\/125092_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_125\/125092_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_125\/125092_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_125\/125092_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_125\/125092_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_125\/125092_0h_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13916</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attr