 celom svete. - Funkčný, rozumný dizajn a štýl pre mobilných profesionálov - Praktické riešenie, ktoré poskytuje základnú ochranu počítača - cestuje a zmestí sa takmer kamkoľvek - Veľké predné vrecko na uloženie súborov, káblov a príslušenstva - Robustné dvojité rukoväte a protišmykový ramenný popruh poskytujú pohodlnú a istú prepravu - Ľahké, odolné a ľahko udržiavateľné materiály odolávajú vode a opotrebovaniu Vonkajší materiál - 97% polyester / 3% PVC - Úložný priestor: (1) predné úložné vrecko s krytom s chlopňou a zapínaním na háčik - Nastaviteľný ramenný popruh, 1.2 m (4 ft.), odnímateľný - Dvojité popruhové držadlá Vnútorný priestor - 100% polyester s expandovanou polyetylénovou (EPE) penou - Úložný priestor: (1) hlavný úložný priestor Rozmery - Vonkajšie: 31 x 41 x 7 cm (12 x 16 x 2.75 in.) - Vnútorný priestor: 29 x 39 x 5 cm (11.5 x 15.3 x 2 palce.)* - Predné vrecko: vonkajšie, 26 x 35 x 4 cm (10.25 x 13.75 x 1.5 in.); interiér, 24 x 34 x 3 cm (9.5 x 13.5 x 1.2 in.)  - 0.6 kg (1.4 lb.) * Vždy zmerajte vonkajšiu časť zariadenia, aby ste určili kompatibilitu. Všetky rozmery tašky sú približné a môžu sa mierne líšiť..","true","39","0001022300060003","8462","-1","true","","-1","-1","true","2","Rok(ů)","","0001-01-01T00:00:00","140.00","KS","99","5","2019-10-14T14:52:36.187","MAN","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_437\/437102_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_437\/437102_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_437\/437102_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_437\/437102_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_437\/437102_0e_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributec