bez obav do každé destinace.&lt;br /&gt;&lt;br /&gt;&lt;strong&gt;Specifikace&lt;/strong&gt;&lt;br /&gt;&lt;br /&gt;Odpovídá velikosti kabinových zavazadel podle doporučení IATA.&lt;br /&gt;Vyjímatelná polstrovaná brašna pro notebooky včetně kapsy na tablet.&lt;br /&gt;Uzamykatelná přední kapsa pro snadné vyjmutí notebooku při rentgenu zavazadel.&lt;br /&gt;Kapsa pro napájecí zdroj a kabely.&lt;br /&gt;Kapsa pro dokumenty a cestovní pas.&lt;br /&gt;Objemná hlavní přihrádka s integrovaným TSA zámkem.&lt;br /&gt;Fixační popruhy a vnitřní kapsy pro oděvy, obuv, toaletní potřeby.&lt;br /&gt;Čtyři snadno ovladatelné a tiché kolečka otočné o 360°.&lt;br /&gt;Robustní dvoustupňová teleskopická rukojeť vyrobená z vysoce kvalitního hliníku.&lt;br /&gt;Odolný vůči znečištění a vodu odpuzující materiál na spodní straně zavazadla.&lt;br /&gt;Vestavěná jmenovka na adresu.&lt;br /&gt;Materiál: Polyester&lt;br /&gt;Hmotnost: 3.9 kg&lt;br /&gt;Objem 49L&lt;br /&gt;Rozměry: 400 x 550 x 230 mm&lt;br /&gt;Pro notebooky do velikosti: 385 x 265 x 35 mm&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p dir='LTR' align='LEFT'&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","3859.00","KS","0.00","9","2019-05-16T09:54:48.96","DIC","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_620\/620307_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_620\/620307_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_620\/620307_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_620\/620307_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_620\/620307_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_620\/620307_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_620\/620307_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_620\/620307_0h_3.jpg','8':'https:\/\/c.edsystem.cz\/IMGCACHE\/_620\/620307_0i_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode> 