ihrádce. Systém vnitřního vedení kabelů umožňuje dobíjet Váš smartphone nebo tablet pomocí powerbanky. Pouzdro na cestovní pas má zabudovanou ochranu proti oskenování RFID čipu, a tím ochrání Vaše osobní data. Objemná hlavní přihrádka poskytuje dostatek místa pro oblečení a toaletní potřeby. Využijte fixačních popruhů a uspořádejte své věci. Detaily, jako je zabudovaný štítek na adresu, spolu s robustní konstrukcí a voděodolným materiálem dělá z tohoto zavazadla skvělého společníka pro volný čas i pracovní cesty.&lt;br /&gt;&lt;br /&gt;&lt;strong&gt;Specifikace&lt;/strong&gt;&lt;br /&gt;• Odpovídá velikosti kabinových zavazadel podle doporučení IATA.&lt;br /&gt;• Polstrované ramenní popruhy je možné ukrýt uvnitř batohu. &lt;br /&gt;• Uzamykatelná polstrovaná přední kapsa s popruhy proti nežádoucímu pohybu notebooku.&lt;br /&gt;• Polstrovaná kapsa pro iPad a ostatní tablety do 12,9“.&lt;br /&gt;• Kapsa pro dokumenty a cestovní pas s ochranou proti oskenování dat ( RFID scan protection).&lt;br /&gt;• Vnitřní vedení kabelů pro nabíjení smartphonů a tabletů pomocí powerbanky.&lt;br /&gt;• Objemná hlavní přihrádka s fixačními popruhy pro oděvy, obuv, toaletní potřeby.&lt;br /&gt;• Robustní dvoustupňová teleskopická rukojeť &lt;br /&gt;• Odolný a vodu odpuzující materiál.&lt;br /&gt;• Vyměnitelná tichá kolečka&lt;br /&gt;• Vestavěná jmenovka na adresu.&lt;br /&gt;• Materiál: Polyester&lt;br /&gt;• Hmotnost: 3.3 kg&lt;br /&gt;• Objem 40l&lt;br /&gt;• Rozměry: 365 x 500 x 230 mm&lt;br /&gt;• Pro notebooky do velikosti: 415 x 280 x 40 mm&lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","24","Měsíc(ů)","","0001-01-01T00:00:00","4238.00","KS","0.00","6","2018-05-31T15:41:53.143","DIC","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_625\/625596_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_625\/625596_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_625\/625596_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_625\/625596_0d_3.jpg','4':'https:\