i dizajnovými detailmi   Prvotriedne látky zahŕňajú trvanlivý balistický materiál, leštenej mäkčené vyloženie a vode odolné materiály  Patentované ochranné popruhy, uschovateľný držiak na fľašu a uschovateľný držiak na letenku sú jedinečnými inováciami určenými práve pre rad tašiek Meridian II.  Vlastnosti   Typ produktu: Taška na notebook  Materiál: nylon 1680D  Kompatibilita s notebookmi: 39,62 cm (15,6 ')  Ďalšie oddiely: na mobilný telefón, perá, osobné predmety, vizitky  Vlastnosti: vodotesná, odolná proti poškriabaniu, polstrovaná, odolná proti nárazu, odopínateľná vrecko, nastaviteľný remeň cez rameno, príprava na dokumenty  Remeň: remeň cez rameno","false","22","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","2022-09-21T00:00:00","1237.00","KS","0.00","5","2022-06-22T10:32:56.557","DLL","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1422\/1422201_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1422\/1422201_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1422\/1422201_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1422\/1422201_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1422\/1422201_0e_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>8711</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1002</attributecode>          <valuecode>12064</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>1.84</weight>          <length>44</length>          <width>14</width>          <height>42</height>        </productlogisticdata>      ","N","","false",""),(