 štýl s komfortom a pohodlím pri cestovaní po meste, cez celú krajinu alebo po celom svete. - Funkčný, rozumný dizajn a štýl pre mobilných profesionálov - Praktické riešenie, ktoré poskytuje základnú ochranu počítača - cestuje a zmestí sa takmer kamkoľvek - Veľké predné vrecko na uloženie súborov, káblov a príslušenstva - Robustné dvojité rukoväte a protišmykový ramenný popruh poskytujú pohodlnú a istú prepravu - Ľahké, odolné a ľahko udržiavateľné materiály odolávajú vode a opotrebovaniu Vonkajší materiál - 97% polyester / 3% PVC - Úložný priestor: (1) predné úložné vrecko s krytom s chlopňou a zapínaním na háčik - Nastaviteľný ramenný popruh, 1.2 m (4 ft.), odnímateľný - Dvojité popruhové rukoväte Vnútorný priestor - 100 % polyester s expandovanou polyetylénovou (EPE) penou - Úložný priestor: (1) hlavný úložný priestor * Na určenie kompatibility vždy zmerajte vonkajšiu časť zariadenia. Všetky rozmery tašky sú približné a môžu sa mierne líšiť..","false","22","0001022300060003","8462","-1","true","","-1","-1","true","2","Rok(ů)","","2022-10-03T00:00:00","127.00","KS","0.00","4","2019-10-14T14:46:57.69","MAN","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1492\/1492400_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1492\/1492400_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1492\/1492400_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1492\/1492400_0d_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>9384</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1002</attributecode>          <valuecode>12025</valuecode>        </productnavigatordata>      ","        <p