s: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Počítačový kufrík Manhattan London Notebook je praktické riešenie s elegantným tradičným štýlom, ktoré sa ľahko prenáša a zmestí sa takmer kamkoľvek - pod sedadlá lietadiel, do horných priehradiek a do väčších kusov batožiny. V jednom širokom hlbokom prednom vrecku sú vaše dôležité predmety, doklady a príslušenstvo v bezpečí, ale na dosah. Jeho zabezpečená klapka so zatváraním chráni uložený obsah. Dvojité rukoväte so zosilneným prešívaním a nastaviteľný, odnímateľný ramenný popruh poskytujú mobilným profesionálom viacúčelové možnosti prenášania. &lt;h2 style='margin: 0.5em 0px; color: #005383; text-transform: none; line-height: 1.4; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 1.33em; font-style: normal; font-weight: bold; word-spacing: 0px; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Základné a funkčné ukladanie&lt;/h2&gt; &lt;p style='margin: 0px 0px 15px; color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Jeho vnútro s polstrovaným priestorom na počítač je vhodné pre väčšinu notebookov s obrazovkou do 17.3'. Konfigurácia s horným nakladaním umožňuje rýchle balenie a rýchlu letiskovú kontrolu. Vo veľkom vnútornom priestore, ktorý sa nepoškriabe, je dostatok miesta na uloženie spisov, papierov a časopisov. &lt;h2 style='margin: 0.5em 0px; color: #005383; text-transform: none; line-height: 1.4; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 1.33em; font-style: normal; font-weight: bold; word-spacing: 0px; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Krásne navrhnuté na výkon&lt;/h2&gt; &lt;p style='margin: 0px 0px 15px; color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Vonkajšia a vnútorná časť je starostlivo vyrobená z ľahkých, odolných a ľahko udržiavateľných materiálov, ktoré odolávajú vode a opotrebovaniu. Odolný hardvér aktovky zahŕňa zipsy s robustnými ťaháčikmi, ktoré zabezpečujú hladký chod s menším počtom zádrheľov. Počítačové puzdro Manhattan spája vynikajúcu ochranu počítača a atraktívny štýl s komfortom a pohodlím pri cestovaní cez mesto, na druhý koniec krajiny alebo po celom svete. &lt;p style='margin: 0px 0px 15px; color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;                              &lt;p style='margin: 0px 0px 15px; color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;ul style='margin: 0px 0px 1em 20px; padding: 0px; color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Funkčný, rozumný dizajn a štýl pre mobilných profesionálov&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Praktické riešenie, ktoré poskytuje základnú ochranu počítača - cestuje a zmestí sa takmer kamkoľvek&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Veľké predné vrecko na uloženie súborov, káblov a príslušenstva&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Robustné dvojité rukoväte a protišmykový ramenný popruh na pohodlnú a istú prepravu&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Ľahké, odolné a ľahko udržiavateľné materiály, ktoré odolávajú vode a opotrebovaniu&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Trojročná záruka&lt;/li&gt; &lt;/ul&gt; &lt;p&gt;&lt;span style='color: #333333; font-family: Arial;'&gt;Špecifikácia&lt;/span&gt; &lt;ul style='margin: 0px 0px 1em 20px; padding: 0px; color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;97% polyester / 3% PVC&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Úložný priestor: (1) predné úložné vrecko s chlopňou a zapínaním na háčik a slučku&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Nastaviteľný ramenný popruh, 1.2 m (4 ft.), odnímateľné&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Dvojité popruhové rukoväte&lt;br style='box-sizing: border-box;' /&gt;&lt;br style='box-sizing: border-box;' /&gt;Interiér&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;100% polyester s expandovanou polyetylénovou penou (EPE)&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Úložný priestor: (1) hlavný úložný priestor&lt;br style='box-sizing: border-box;' /&gt;&lt;br style='box-sizing: border-box;' /&gt;Rozmery&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Vonkajšie rozmery: 45 x 33 x 8.5 cm (17.71 x 12.99 x 3.35 in.)&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Interiér: 44 x 32 x 7.5 cm (17.32 x 12.60 x 2.95 in.)*&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Predné vrecko: vonkajšie, 38.2 x 25.6 x 2 cm (15.04 x 10.08 x 0.79 in.); Interiér, 38.2 x 25.6 x 2 cm (15.04 x 10.08 x 0.79 in.)&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;0.43 kg (1.4 lb.)&lt;br style='box-sizing: border-box;' /&gt;&lt;br style='box-sizing: border-box;' /&gt;* Vždy zmerajte vonkajšiu časť zariadenia, aby ste určili kompatibilitu. Všetky rozmery tašky sú približné a môžu sa mierne líšiť.&lt;/li&gt; &lt;/ul&gt;.","false","0","0001022300060003","8462","-1","true","","-1","-1","true","2","Rok(ů)","","0001-01-01T00:00:00","151.00","KS","21.00","3","2019-10-14T14:37:12.847","MAN","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1492\/1492406_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1492\/1492406_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1492\/1492406_0c_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>9301</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1002</attributecode>          <valuecode>12121</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0.443</weight>          <length>47</length>          <width>38</width>          <height>4</height>        </productlogisticdata>        <productlogisticdata>          <typ>PACK</typ>          <count>25</count>          <weight>11.99</weight>          <length>52</length>          <width>43</width>          <height>51</height>        </productlogisticdata>      ","N","","false",""),("1492664","669287","Umax Laptop Bag 12","318.00","318.00","UMX","0.00","0