y or&lt;br /&gt;design. The backpack offers excellent protection for your devices and is comfortable and easy to carry. Designed for daily use.&lt;br /&gt;Equipped with practical functions that make your life easier.&lt;/p&gt;  &lt;p&gt;&lt;br /&gt;&lt;strong&gt;Specifications&lt;/strong&gt;&lt;br /&gt;Art.no.: D31735&lt;br /&gt;EAN: 7640158669204&lt;br /&gt;Weight: 0.691 kg&lt;br /&gt;Volume: 19.5 liter&lt;br /&gt;Material: 600D recycled PET&lt;br /&gt;Warranty: Lifetime / 30 years&lt;br /&gt;Dimension: 295 x 450 x 170 mm&lt;br /&gt;Max. Device dimensions: 385 x 35 x 265 mm&lt;/p&gt;  &lt;p&gt;&lt;br /&gt;&lt;strong&gt;Characteristics&lt;/strong&gt;&lt;br /&gt;• Manufactured out of 13 recycled PET bottles&lt;br /&gt;• Lockable notebook compartment, surrounded by&lt;br /&gt;High-Density Foam (HDF) as protective padding&lt;br /&gt;• Reliable fastening for devices thanks to the elastic notebook&lt;br /&gt;securing strap&lt;br /&gt;• Spacious main compartment with padded compartment for&lt;br /&gt;tablets measuring up to 10.5''&lt;br /&gt;• Expandable inner pocket with fastening strap for&lt;br /&gt;headphones&lt;br /&gt;• Front pocket with functional compartments for smartphone,&lt;br /&gt;power bank, pens and other items&lt;br /&gt;• Space-saving side pockets for an umbrella or water bottle&lt;br /&gt;• Ergonomic back padding and comfortable shoulder straps&lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","30","Rok(ů)","","0001-01-01T00:00:00","1170.00","KS","0.00","7","2019-12-06T10:10:29.727","DIC","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1499\/1499422_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1499\/1499422_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1499\/1499422_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1499\/1499422_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1499\/1499422_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1499\/1499422_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1499\/14994