 the secure transportation of the notebook and printer! The new, pull-out paper tongue catches your printed documents up to DIN A4 in size. The special 'Floor-to-desk' principle, developed by DICOTA, means that the printer and mains adapter remain completely wired within the case during use. The notebook can be freely used on the table. The Data Box XL Trolley is also lockable; two keys are supplied.    Data is conventionally transferred by means of printer cables or via Bluetooth. The printer is operated and the battery is charged via the 220/230 V low heat device connector on the outer shell of the case. The low heat device connector can be covered with a rubber cap for transportation. The detachable trolley system ensures a particularly convenient transportation of your mobile office. If you should at some stage not need the trolley function, the trolley system can be very simply removed with a quick movement. The Data Box XL Trolley is suitable for all popular notebooks up to 15.6' in size, and for mobile printer HP OJ 250 - with or without support for the Canon Portable Kit. Other printers available upon request. The printer mounting for the mobile printer HP OJ 250 integrated in the case box, depending on the model. When you replace your printer, this printer mounting can be replaced by the other model (available as an optional extra) simply by undoing four Allen screws  Padded notebook pocket  Particularly robust housing  'Floor-to-Desk' principle  Internal cabling  Lockable box, two keys included  220 V low heat device connector on the outer shell of the case  Data transfer by conventional means or via Bluetooth  Detachable trolley system  Precise fit for the HP OJ 250  More Information  More Information  Item number	D31846  Color	black  Volume in liters	0  Material	Aluminium / Con-Pearl  Warranty	24 months  EAN	7640186419796  Max. Device Measurements (mm)	410 x 310 x 60 mm  16.14 x 12.2 x 2.36 inch  Product Measurements (mm)	455 x 445 x 280 mm  17.91 x 17.5