exible mobility. The spacious main section is divided so that documents and accessories can be stored separately. The front pocket has practical smaller compartments so you can organise smaller items like your smartphone, pens or chargers. There is space for your water bottle or umbrella in the easily accessible mesh side pockets. You can therefore ensure that everything you need is always to hand. The backpack's ergonomic padding makes it comfortable to wear on your back and the shoulder straps can also be adjusted for further comfort. The Eco Backpack BASE is therefore perfect for you if you are always on the go and want to support the recycling of PET bottles with an eco-friendly bag.&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div id='custom-1' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: right; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; box-shadow: none; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;ul style='margin-top: 0px; margin-bottom: 1rem; list-style-type: square; box-sizing: border-box; padding-inline: 0px;'&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Made of 11 recycled PET bottles&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;28 litre storage space&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: borde