; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;h1 class='page-title' style='margin: 0px 0px 13.5px; color: #555555; line-height: 1; font-family: 'Futura LT W05 Bold'; font-size: 28px; font-weight: 600; box-sizing: border-box;'&gt;&lt;span class='base' style='box-sizing: border-box;' data-ui-id='page-title-wrapper'&gt;Eco Multi BASE 14-15.6 Grey&lt;/span&gt;&lt;/h1&gt;  &lt;/div&gt;  &lt;div class='product-info-price' style='width: 547.87px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; margin-bottom: 15px; word-spacing: 0px; border-bottom-color: #ebebeb; border-bottom-width: 1px; border-bottom-style: solid; display: table; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;div style='display: table-row; box-sizing: border-box;'&gt;  &lt;p style='margin: 0px 0px 1rem; box-sizing: border-box;'&gt;A light notebook case with protective padding&lt;/p&gt;  &lt;div id='product_info_description' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: right; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; box-shadow: none; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Today's actions shape tomorrow's world. Which is why, here at DICOTA, we are dedicated to developing environmentally friendly solutions and therefore make all the items in our ECO collections out of sustainable, recycled PET. We reuse up to 19 PET bottles, so you will receive an environmentally friendly product with a life-long guarantee. Our PET products also have the quality, look and finish that you know and love.&lt;br style='box-sizing: border-box;' /&gt;&lt;br style='box-sizing: border-box;' /&gt;  &lt;div class='product attribute description' style='box-sizing: border-box;'&gt;  &lt;div class='value' style='box-sizing: border-box;'&gt;The compact Eco Multi BASE case offers ideal protection for your laptop thanks to its padded notebook compartment. The case fully protects devices between 14 and 15.6' and the elastic strap also secures them within their compartment. The Eco Multi BASE guarantees extra stability and protection with its metal frame, as well as flexible mobility thanks to its lightweight design. Your smartphone or other smaller items like cables, pens or chargers can be stored in the convenient front pocket, so they are always to hand. The case's handles make it comfortable to carry and it can be attached to a suitcase in seconds with its built-in strap. It can also be carried using its adjustable shoulder strap. The Eco Multi BASE is therefore perfect for you if you always on the go and want to support the recycling of PET bottles with an eco-friendly case.&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div id='custom-1' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futu