 support the recycling of PET bottles with an eco-friendly case.&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div id='custom-1' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: right; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; box-shadow: none; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;ul style='margin-top: 0px; margin-bottom: 1rem; list-style-type: square; box-sizing: border-box; padding-inline: 0px;'&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Made of 9 recycled PET bottles&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Padded notebook compartment&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Metal frame for extra protection&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;High-quality metal features&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Notebook security strap&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Document compartment on the back&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Front p