 font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;div style='display: table-row; box-sizing: border-box;'&gt;  &lt;p style='margin: 0px 0px 1rem; box-sizing: border-box;'&gt;A light notebook case with protective padding&lt;/p&gt;  &lt;div id='product_info_description' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: right; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; box-shadow: none; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Today's actions shape tomorrow's world. Which is why, here at DICOTA, we are dedicated to developing environmentally friendly solutions and therefore make all the items in our ECO collections out of sustainable, recycled PET. We reuse up to 19 PET bottles, so you will receive an environmentally friendly product with a life-long guarantee. Our PET products also have the quality, look and finish that you know and love.&lt;br style='box-sizing: border-box;' /&gt;&lt;br style='box-sizing: border-box;' /&gt;  &lt;div class='product attribute description' style='box-sizing: border-box;'&gt;  &lt;div class='value' style='box-sizing: border-box;'&gt;The compact Eco Multi BASE case offers ideal protection for your laptop thanks to its padded notebook compartment. The case fully protects devices between 13 and 14.1' and the elastic strap also secures them within their compartment. The Eco Multi BASE guarantees extra stability and protection with its metal frame, as well as flexible mobility thanks to its lightweight design. Your smartphone or other smaller items like cables, pens or chargers can be stored in the convenient front pocket, so they are always to hand. The case's handles make it comfortable to carry and it can be attached to a suitcase in seconds with its built-in strap. It can also be carried using its adjustable shoulder strap. The Eco Multi BASE is therefore perfect for you if you always on the go and want to support the recycling of PET bottles with an eco-friendly case.&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div id='custom-1' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: right; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; box-shadow: none; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;ul style='margin-top: 0px; margin-bottom: 1rem; list-style-type: square; box-sizing: border-box; padding-inline: 0px;'&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Made of 8.5 recycled PET bottles&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Padded notebook compartment&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Metal frame for extra protection&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;High-quality metal features&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Notebook security strap&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Document compartment on the back&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Front pocket with storage space for mobile accessories&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Comfortable padded handle&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Removable, adjustable shoulder strap&lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;div id='additional' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: right; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; box-shadow: none; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;h2 style='color: inherit; line-height: 1.2; font-family: 'Futura LT W05 Bold'; font-size: 2rem; font-weight: 500; margin-top: 0px; margin-bottom: 0.5rem; box-sizing: border-box;'&gt;More Information&lt;/h2&gt;  &lt;div class='additional-attributes-wrapper table-wrapper' style='margin: 0px; box-s