oration-style: initial; text-decoration-color: initial;'&gt;Today's actions shape tomorrow's world. Which is why, here at DICOTA, we are dedicated to developing environmentally friendly solutions and therefore make all the items in our ECO collections out of sustainable, recycled PET. We reuse up to 19 PET bottles, so you will receive an environmentally friendly product with a life-long guarantee. Our PET products also have the quality, look and finish that you know and love.&lt;br style='box-sizing: border-box;' /&gt;&lt;br style='box-sizing: border-box;' /&gt;  &lt;div class='product attribute description' style='box-sizing: border-box;'&gt;  &lt;div class='value' style='box-sizing: border-box;'&gt;The Eco Slim Case Plus BASE offers ideal protection for laptops between 13 and 15.6' thanks to its high-density foam (HDF) padding. The case fully protects your device and the elastic strap also secures it within its compartment. The case is comfortable to carry thanks to its padded carrying handle and adjustable shoulder strap. There is an extra compartment on the back, in which you can easily store documents. Your smartphone or other smaller items like cables, pens or chargers can be stored in the convenient front pocket, so they are always to hand. There is also a separate compartment for your power bank and cables, so you can keep them organised. The Eco Slim Case Plus BASE is therefore perfect for you if you are always on the go and want to support the recycling of PET bottles with an eco-friendly bag.&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div id='custom-1' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: rig