; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;div style='display: table-row; box-sizing: border-box;'&gt;  &lt;p style='margin: 0px 0px 1rem; box-sizing: border-box;'&gt;A light notebook backpack with protective padding and lots of compartments&lt;/p&gt;  &lt;div id='product_info_description' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: right; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; box-shadow: none; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Today's actions shape tomorrow's world. Which is why, here at DICOTA, we are dedicated to developing environmentally friendly solutions and therefore make all the items in our ECO collections out of sustainable, recycled PET. We reuse up to 19 PET bottles, so you will receive an environmentally friendly product with a life-long guarantee. Our PET products also have the quality, look and finish that you know and love.&lt;br style='box-sizing: border-box;' /&gt;&lt;br style='box-sizing: border-box;' /&gt;  &lt;div class='product attribute description' style='box-sizing: border-box;'&gt;  &lt;div class='value' style='box-sizing: border-box;'&gt;The compact Plus BASE backpack offers ideal protection for laptops between 13 and 15.6' thanks to its high-density foam (HDF) padding. The case fully protects your device and the elastic strap also secures it within its compartment. The spacious main section is divided so that documents and accessories can be stored separately. The front pocket has practical smaller compartments so you can organise smaller items like your smartphone, pens or chargers. You can safely store your passport, wallet or other valuables in the hidden zipped compartment on the back of the case. There is space for your water bottle or umbrella in the easily accessible mesh side pockets. You can therefore ensure that everything you need is always to hand. The backpack's ergonomic padding makes it comfortable to wear on your back and the shoulder straps can also be adjusted for further comfort. The Eco Backpack Plus BASE is therefore perfect for you if you are always on the go and want to support the recycling of PET bottles with an eco-friendly bag.&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div id='custom-1' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: right; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; box-shadow: none; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;ul style='margin-top: 0px; margin-bottom: 1rem; list-style-type: square; box-sizing: border-box; padding-inline: 0px;'&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Made of 12 recycled PET bottles&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;24 litre storage space&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Padded notebook compartment with high density foam (HDF)&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Notebook security strap&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;High-quality metal features&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Spacious main section with compartments for documents&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Extra compartment for power bank and cables&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Hidden zipped compartment for passport, wallet, etc.&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Easily accessible mesh side pockets for water bottle or umbrella&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Comfortable padded handle&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Removable, adjustable shoulder strap&lt;/li&gt;  &lt;/ul&gt;  &lt;/div&gt;  &lt;div id='additional' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float