nitial; text-decoration-color: initial;'&gt;Today's actions shape tomorrow's world. Which is why, here at DICOTA, we are dedicated to developing environmentally friendly solutions and therefore make all the items in our ECO collections out of sustainable, recycled PET. We reuse up to 31 PET bottles, so you will receive an environmentally friendly product with a life-long guarantee. Our PET products also have the quality, look and finish that you know and love.&lt;br style='box-sizing: border-box;' /&gt;&lt;br style='box-sizing: border-box;' /&gt;  &lt;div class='product attribute description' style='box-sizing: border-box;'&gt;  &lt;div class='value' style='box-sizing: border-box;'&gt;Travel '1st class' with the Eco Top Traveller PRO. The toploader bag reliably accompanies you everywhere and meets the highest standards of quality, functionality and protection: DICOTA's attention to detail makes this bag one of your most reliable business partners! The fitall system separating wall in the notebook compartment lies protectively across your notebook and fits automatically to sizes from 15-17.3'. The perforated and thus light EVA foam material in the lockable notebook compartment perfectly protects the edges of your device. The anti slip technology coating ensures perfect grip for your notebook in the compartment. Excellent protection for your tablet up to 12.9' thanks to the EVA-shaped compartment with extra-soft Nylex inner lining. Generous storage space for documents. The front pocket with keychain and insert pockets allows to organise the personal equipment and provides space for additional mobile accessories. Additional pocket for charger and cables. The bag is light and comfortable in your hand thanks to the high-quality genuine leather handles. Trolley strap can also be used as an additional document compartment. Bag bottom is made from waterproof material. The Eco Top Traveller PRO is therefore perfect for you if you are always on the go and want to support the recycling of PET bottles with an eco-friendly case.&lt;/div&gt;  &lt;/div&gt;  &lt;/div&gt;  &lt;div id='custom-1' class='data item content' style='background: #ffffff; border-width: 1px 0px 0px; margin: 0px; padding: 25px 0px; width: 1118.48px; text-align: left; color: #3e3e3e; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: 'Futura LT W04 Light1475790'; font-size: 16px; font-style: normal; font-weight: 400; word-spacing: 0px; border-top-color: #eeeeee; border-top-style: solid; float: right; display: block; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; box-shadow: none; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;ul style='margin-top: 0px; margin-bottom: 1rem; list-style-type: square; box-sizing: border-box; padding-inline: 0px;'&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Made of 27 recycled PET bottles&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Lockable and cushioned notebook compartment with fitall system and anti slip technology&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Maximum security thanks to Memory Foam and EVA frame protection&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;EVA moulded slip pocket with Nylex material for tablets up to 12.9'&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;High-quality metal features&lt;/li&gt;  &lt;li style='margin-top: 0px; margin-bottom: 0.9rem; list-style-position: inside; box-sizing: border-box;'&gt;Spacious front pocket with zip-pocket, k