ovky:14.1'; Úhlopříčka displeje:14,1'","1","&lt;p&gt;Laptop Backpack B2 12–14.1&lt;/p&gt;  &lt;p&gt;Your electronic device will arrive at its destination safely with the BASE XX notebook backpack. Your notebook measuring up to 14.1' is well protected in the padded slot pocket&lt;/p&gt;  &lt;p&gt;A fastening strap also ensures that your device is held in place securely without slipping. The 13 litre lockable main compartment offers additional space for documents and personal items. Save space by storing your bottle and umbrella in the side pockets. Mobile accessories such as your smartphone, business cards, pens and so on are always within easy reach in the zip pocket on the front. The padded shoulder strap and comfortable handle make the rucksack very easy to carry. All in all, a functional carrying solution for reliable protection both in a professional and private capacity. BASE XX emphasises the durability of the product with an extended five year guarantee.&lt;/p&gt;  &lt;p&gt;Art.No. Screen size Notebook size D31850 12 – 14.1' ? 385 × 245 × 35 mm ? 15.2 × 10.4 × 1.6 inches Cushioned and lockable notebook compartment Notebook strap keeps the notebook securely in place in the compartment Pocket on front with designated compartments for accessories such as mobile phone and pens etc. Further space for documents Side mesh pockets&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;","false","0","","-1","-1","true","","-1","-1","true","5","Rok(ů)","","0001-01-01T00:00:00","369.00","KS","0.00","1","2021-08-31T09:25:29.703","DIC","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1591\/1591962_0a_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13916</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode