ation for mobile accessories  Comfortable carrying handle and removable shoulder strap    Handy notebookbag with protection.    Art. No.	D31855  Weight	0.55 kg  Screen size	  15 – 17.3”    Notebook size	  ? 430 x 300 x 50 mm; ? 16.93 x 11.81 x 1.97 inches    Warranty	  5 years extended warranty","false","0","","-1","-1","true","","-1","-1","true","5","Měsíc(ů)","","0001-01-01T00:00:00","380.00","KS","0.00","1","2021-08-31T09:39:55.923","DIC","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1591\/1591967_0a_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>9301</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1002</attributecode>          <valuecode>12121</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>JEDN</typ>          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1592239","937630","DICOTA Eco Backpack PRO 15-17.3” Black","2280.00","2280.00","DIC","0.00","0.00","0.000000","0.000","30 Rok(ů)","DICOTA","2980.00","2980.00","21.00","D30847-RPET","false","0,00","","Dicota","42021299","7640186419932","DICOTA Eco Backpack PRO 15-17.3” Black","Barva:Černá; Typ:Batoh; Úhlopříčka obrazovky:17.3'; Materiál:rPET; Úhlopříčka displeje:17,3'","1","&lt;p&gt;Backpack PRO je profesionální batoh s vytříbenou funkčností. Představuje nejvyšší standard kvality, funkčnosti a ochrany. Batoh pro 15“ – 17,3“ notebook disponuje speciálním systémem připevňovacích prvků (popruh, přilnavá vrstva v oddělení pro noteboo