EKTRONIKA","966.00","1074.00","21.00","TOM-A13-C02D","false","0,00","","NoName","42029180","6970412220751","tomtoc Sleeve – 13' MacBook Pro / Air (2016+), černá","Barva:Černá; Typ:Pouzdro; Úhlopříčka obrazovky:13'; Materiál:Polyester","1","&lt;p&gt;tomtoc Sleeve – 13' MacBook Pro / Air (2016+), černá&lt;/p&gt;  &lt;p&gt;Stylový sleeve od značky tomtoc určený na 13' MacBook Pro / Air (2016+) vám nesmí chybět. Dokonale padnoucí střih a funkční design doplní váš formální i neformální styl a spolehlivě ochrání vložené zařízení.&lt;/p&gt;  &lt;p&gt;Notebook před poškrábáním velmi důkladně chrání bohatá 360° vnitřní výstelka z mikroplyše. Ochranu zařízení na vytížených rozích zajistí patentovaný systém výztuží, které pohltí energii nárazu. Díky velké vnější kapse, do které se vejde nezbytné příslušenství, budete mít vše po ruce.&lt;/p&gt;  &lt;p&gt;• Obal na nový 13' MacBook Pro / Air (2016+)&lt;br /&gt;• Dvojitá vnitřní ochrana&lt;br /&gt;• Samojistící zipy&lt;br /&gt;• Vnější kapsa&lt;br /&gt;• Max. velikost zařízení: 30,5 x 21,2 x 1,6 cm&lt;br /&gt;• Vnější rozměry: 32 x 23 x 2,8 cm&lt;/p&gt;  &lt;p&gt;Upozornění: obal je příliš malý na 13' starší verze MacBooku Air / Pro Retina a další obvyklé 13' notebooky. Všechna kompatibilní zařízení najdete níže.&lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;p&gt; &lt;/p&gt;  &lt;h2 style='color: #777777; text-transform: none; line-height: 1.1; text-indent: 0px; letter-spacing: normal; font-family: Arial, Helvetica, sans-serif; font-size: 2rem; font-style: normal; font-weight: 300; margin-top: 2.25rem; margin-bottom: 1.8rem; word-spacing: 0px; white-space: normal; box-sizing: inherit; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Notebook zůstane jako nový&lt;/h2&gt;  &lt;p&gt;&lt;span style='color: #777777; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;360° vnitřní ochrana zahrnuje bohatou výstelku z mikroplyše, která na všech místech kryje zip i zevnitř tak, &lt;/span&gt;&lt;strong style='color: #777777; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-weight: bold; word-spacing: 0px; white-space: normal; box-sizing: inherit; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;aby nedošlo k poškrábání šasí&lt;/strong&gt;&lt;span style='color: #777777; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;. Výstelka je velmi bohatá, takže snadno absorbuje veškeré nárazy a otřesy, které vznikají při přenášení notebooku.&lt;/span&gt;&lt;br style='color: #777777; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Arial, Helvetica, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal