stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Taška na notebook Clamshell - inteligentný, pohodlný dizajn pre váš notebook&lt;/h2&gt; &lt;p style='margin: 0px 0px 15px; color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;Mnohé tašky na notebooky sa vkladajú zhora, čo znamená, že v hlavnom priestore tvoria akési vedro. Ak máte vnútorné vrecko s viacerými doplnkami, ste nútení ich baliť vertikálne na seba. Plné otváranie tašky Manhattan Cambridge Notebook Bag 15.6' umožňuje oveľa pohodlnejší prístup do vnútorného priestoru. Táto konštrukcia vám umožní ľahšie nájsť správnu položku a je tiež veľkým pomocníkom pri manipulácii s notebookom pri bezpečnostných kontrolách na letisku. Okrem toho je taška na notebook Cambridge vybavená mnohými možnosťami uloženia, ktoré na svojej ceste určite radi využijete. Nikdy neviete, kam bezpečne odložiť vizitky svoje alebo svojich zákazníkov? V samostatnom malom vrecku sú v bezpečí a nepokrčené. Veľké predné, zadné a vnútorné vrecká ponúkajú dostatok priestoru na káble, súbory, slúchadlá a ďalšie veci. Samotný priestor na notebook je dostatočne polstrovaný, aby chránil vaše cenné zariadenie pred nárazmi a škrabancami. Vďaka kompaktnému dizajnu možno túto tašku na notebook ľahko uložiť do vreciek na sedadle alebo do priehradky nad hlavou. Pevná rukoväť a odnímateľný protišmykový ramenný popruh zabezpečujú bezpečnú a pohodlnú prepravu. &lt;p style='margin: 0px 0px 15px; color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt;  &lt;ul style='margin: 0px 0px 1em 20px; padding: 0px; color: #333333; text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: Raleway, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; white-space: normal; box-sizing: border-box; orphans: 2; widows: 2; background-color: #ffffff; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial;'&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Inteligentný, základný dizajn, ktorý sa hodí pre väčšinu notebookov do 15 rokov.6'&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Plné otváranie s dvoma zipsami na pohodlný prístup do hlavného priestoru&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Odolný vonkajší materiál, ktorý chráni pred poveternostnými vplyvmi, rozliatím a opotrebovaním&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Vystužená rukoväť a protišmykový ramenný popruh na jednoduchú a bezpečnú prepravu&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Veľké predné, zadné a vnútorné vrecká na príslušenstvo&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Veľké predné vrecko s chlopňou a zapínaním na háčik a slučku&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Veľké zadné vrecko so zapínaním na háčik a slučku na rýchly prístup na cestách&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Jedno veľké vnútorné vrecko na spisy, príslušenstvo a ďalšie veci&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Tri kompaktné vnútorné sieťované vrecká na menšie predmety&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Tri vnútorné držiaky na perá&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Jedna vnútorná priehradka na vizitky, aby boli vaše karty pripravené a nepomačkané&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Ideálne pre väčšinu notebookov, ultrabookov™, Macbookov a ďalších&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Skvelý spoločník pri cestovaní lietadlom, ktorý má ideálnu veľkosť na uloženie do odkladacích priestorov nad hlavami&lt;/li&gt; &lt;li style='margin-bottom: 0.4em; box-sizing: border-box;'&gt;Trojročná záruka&lt;/li&gt; &lt;/ul&gt; &lt;/div&gt;.","false","22","0001022300060003","8462","-1","true","","-1","-1","true","3","Rok(ů)","","0001-01-01T00:00:00","218.00","KS","0.00","6","2021-09-22T13:24:21.74","MAN","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1596\/1596276_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1596\/1596276_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1596\/1596276_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1596\/1596276_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1596\/1596276_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1596\/1596276_0f_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>8711</valuecode>        </productnavigatordata>        <produc