de>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1002</attributecode>          <valuecode>12033</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>quantityp>quantity          <count>1</count>          <weight>0.252</weight>          <length>23</length>          <width>16</width>          <height>7</height>        </productlogisticdata>      ","N","","false",""),("1625595","1894037","tomtoc Sleeve – 13' MacBook Pro / Air (2016+), mátová","966.00","966.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","966.00","1074.00","21.00","TOM-A13-C02B","false","0,00","Novinka","NoName","42029180","6970412220775","tomtoc Sleeve – 13' MacBook Pro / Air (2016+), mátová","Barva:Zelená; Typ:Pouzdro; Úhlopříčka obrazovky:13'; Materiál:Polyester","1","&lt;h1&gt;tomtoc Sleeve – 13' MacBook Pro / Air (2016+)&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;&lt;strong&gt;Stylový sleeve od značky tomtoc určený na 13' MacBook Pro / Air (2016+) vám nesmí chybět. Dokonale padnoucí střih a funkční design doplní váš formální i neformální styl a spolehlivě ochrání vložené zařízení.&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Notebook před poškrábáním velmi důkladně chrání bohatá 360° vnitřní výstelka z mikroplyše. Ochranu zařízení na vytížených rozích zajistí patentovaný systém výztuží, které pohltí energii nárazu. Díky velké vnější kapse, do které se vejde nezbytné příslušenství, budete mít vše po ruce.&lt;/p&gt;  &lt;p&gt;• Obal na nový 13' MacBook Pro / Air (2016+)&lt;br /&gt;• Dvojitá vnitřní ochrana&lt;br /&gt;• Samojistící zipy&lt;br /&gt;• Vnější kapsa&lt;br /&gt;• Max. velikost zařízení: 30,5 x 21,2 x 1,6 cm&lt;br /&gt;• Vnější rozměry: 32 x 23 x 2,8 cm&lt;/p&gt;  &lt;p&gt;Upozornění: obal je příliš malý na 13' starší verze MacBooku Air / Pro Retina a další obvyklé 13' notebooky. Všechna kompatibilní zařízení najdete níže.&lt;/p&gt;  &lt;h2&gt;Notebook zůstane jako nový&lt;/h2&gt;  &lt;p&gt;360° vnitřní ochrana zahrnuje bohatou výstelku z mikroplyše, která na všech místech kryje zip i zevnitř tak, aby nedošlo k poškrábání šasí. Výstelka je velmi bohatá, takže snadno absorbuje veškeré nárazy a otřesy, které vznikají při přenášení notebooku.&lt;/p&gt;  &lt;h2&gt;Vnitřní výztuhy ochrání rohy notebooku&lt;/h2&gt;  &lt;p&gt;Zesílené hrany a vyztužené rohy jsou součástí 360° ochrany vloženého zařízení. Plastové chrániče jsou umístěné na rozích, které jsou při pádech vystavené největším nárazům. Notebook tak zůstane v bezpečí, i když vám omylem v obalu vypadne z ruky.&lt;/p&gt;  &lt;h2&gt;Padne jako ulitý&lt;/h2&gt;  &lt;p&gt;Vložte svůj nový a výkonný MacBook do dokonalého, měkkého a bezpečného obalu. Díky tomu, že pouzdro tomtoc perfektně padne na 13' MacBook Air s Retina displejem nebo na 13' MacBook Pro (USB-C), může vaše drahocenné zařízení spolehlivě ochránit.&lt;/p&gt;  &lt;h2&gt;Uspořádejte si svůj digitální život&lt;/h2&gt;  &lt;p&gt;Do prostorné vnější kapsy snadno uložíte i příslušenství, bez kterého se neobejdete. Ušetříte si tak zbytečné nošení několika tašek. Do kapsy obalu se vejde třeba adaptér s kabelem a myš i s hubem.&lt;/p&gt;  &lt;h1&gt;Seznam kompatibilních zařízení&lt;/h1&gt;  &lt;p&gt;13' MacBook Air s Retina displejem (A1932)&lt;br /&gt;13' MacBook Pro s USB-C (A2159, A1989, A1706, A1708)&lt;br /&gt;12.9' iPad Pro (3. gen)&lt;br /&gt;Dell XPS 13&lt;br /&gt;11.6' Samsung HP Dell Thinkpad Chromebook&lt;/p&gt;  &lt;p&gt;&lt;span style='color: #ff0000;'&gt;Upozornění&lt;/span&gt;&lt;/p&gt;  &lt;p&gt;Obal je příliš malý na 13' starší verze MacBooku Air (modely A1466, A1369), starší verze MacBooku Pro Retina (modely A1502, A1425) a další obvyklé 13' notebooky.&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","966.00","KS","0.00","9","2022-07-25T09:58:44.593","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625595_0a_3.jpg','1':'https:\/\/c.e