\/c.edsystem.cz\/IMGCACHE\/_1625\/1625598_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625598_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625598_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625598_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625598_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625598_0h_3.jpg','8':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625598_0i_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10608</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13918</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>8714</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19598</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>quantityp>quantity          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1625599","1894041","tomtoc Sleeve – na 15,6' notebook, černá","1034.00","1034.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","1034.00","1149.00","21.00","TOM-A13-E03D","false","0,00","Novinka","NoName","42029180","6970412228559","tomtoc Sleeve – na 15,6' notebook, černá","Barva:Černá; Typ:Pouzdro; Úhlopříčka obrazovky:15.6'; Materiál:Polyester","1","&lt;h1&gt;tomtoc Sleeve – na 15,6' notebook&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;&lt;strong&gt;Univerzální stylový sleeve tomtoc Versatile A13 s 360° ochranou a zesílenými bezpečnostními prvky perfektně chrání Váš notebook, a ještě k tomu skvěle vypadá. Jednoduchý design perfektně doplní Váš formální i neformální styl. Čisté, lehce elegantní provedení, se zkrátka hodí ke všemu.&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Notebook není levná záležitost, a proto si zaslouží náležitou ochranu. Tu zajišťuje univerzální sleeve Versatile designovaný pro komfortní přenos a spolehlivou ochranu. Pouzdro s vnitřní výztuhou chrání notebook o velikosti až 15,6 palců před poškrábáním, oděry i vážnějším mechanickým poškozením šasí.&lt;/p&gt;  &lt;p&gt;Hlavní kapsa je doplněná o druhou, vnější, do které pohodlně uložíte příslušenství a budete tak mít vše po ruce a na jednom místě.&lt;/p&gt;  &lt;p&gt;• Obal na notebooky do velikosti 15,6'&lt;br /&gt;• Vnější kapsa na příslušenství&lt;br /&gt;• 360° ochrana zařízení&lt;br /&gt;• Plyšové vnitřní polstrování&lt;/p&gt;  &lt;h2&gt;Spolehlivá ochrana ze všech stran&lt;/h2&gt;  &lt;p&gt;Notebook zůstane jako nový, bez jediné prasklinky, a to díky spolehlivé 360° vnitřní ochraně. Patentovaná technologie CornerArmor zajišťuje, že je Vaše zařízení chráněno z každého úhlu. Zesílené hrany a vyztužené rohy s plastovými chrániči ochrání notebook i v případě, kdy Vám pouzdro omylem vyklouzne z ruky.&lt;/p&gt;  &lt;h2&gt;Jako v bavlnce&lt;/h2&gt;  &lt;p&gt;Před poškrábáním a mechanickým poškozením šasí chrání kvalitní vnitřní plyšové polstrování. Silná vnitřní výstelka efektivně absorbuje energii vznikající při nárazu či pádu, tlumí otřesy a zaručuje tak spolehlivou ochranu při přenášení notebooku.&lt;/p&gt;  &lt;h2&gt;Vše v jednom&lt;/h2&gt;  &lt;p&gt;Uspořádejte si svůj digitální život. Nikdo nemá rád nošení několika tašek, proto je tu vnější kapsa, do které spolehlivě vměstnáte veškeré příslušenství – od adaptéru s kabelem, přes myš, až po hub. Kapsa je, stejně jako hlavní přihrádka, opatřená kvalitním zipem YKK, takže se nemusíte bát, že cokoliv po cestě ztratíte.&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1034.00","KS","0.00","6","2022-07-25T10:05:57.997","NON","405","true","0","{'0':'https:\/\/c.edsystem