a vytížených rozích zajistí patentovaný systém výztuží, které pohltí energii nárazu. O bezpečné uložení notebooku se postarají samojistící kvalitní zipy.&lt;/p&gt;  &lt;p&gt;Díky promyšlené vnitřní organizaci a velkým kapsám budete mít veškeré příslušenství vždy po ruce. Přepravu notebooku vám zpříjemní i zatažitelné prostorné madlo.&lt;/p&gt;  &lt;p&gt;• Taška na 13' notebook&lt;br /&gt;• Dvojitá vnitřní ochrana&lt;br /&gt;• Boční vstup&lt;br /&gt;• Samojistící zipy&lt;br /&gt;• Zatažitelné madlo z umělé kůže&lt;br /&gt;• Max. velikost zařízení: 30,5 x 21 x 1,6 cm&lt;br /&gt;• Vnější rozměry: 33 x 24,5 x 3 cm&lt;/p&gt;  &lt;h2&gt;Notebook zůstane jako nový&lt;/h2&gt;  &lt;p&gt;360° vnitřní ochrana zahrnuje bohatou výstelku z mikroplyše, která na všech místech kryje i zip tak, aby nedošlo k poškrábání šasí. Speciálně navržená rukojeť je vám k dispozici, když potřebujete brašnu pohodlně přenést, v opačném případě kopíruje čisté designové linky.&lt;/p&gt;  &lt;h2&gt;Vnitřní výztuhy ochrání rohy notebooku&lt;/h2&gt;  &lt;p&gt;Zesílené hrany a vyztužené rohy jsou součástí 360° ochrany vašeho zařízení. Plastové chrániče jsou umístěné na rozích, které jsou při pádech vystavené největším nárazům. Notebook tak zůstane v bezpečí, i když vám taška omylem vypadne z ruky.&lt;/p&gt;  &lt;h2&gt;Bezpečnější a pohodlnější používání&lt;/h2&gt;  &lt;p&gt;Samosvorné zipy jsou upravené tak, aby se při zapnutí zároveň 'uzamkly' a zabránily samovolnému otevření brašny. Notebook je chráněn před nechtěným vypadnutím a vy můžete využít bezpečný boční vstup, kam se zařízení snadněji vkládá. Design tomtocu si tím pádem vystačí s jediným prostorným uchem, které se snadno používá a samo se vtáhne, když jej nepotřebujete.&lt;/p&gt;  &lt;h2&gt;Uspořádejte si svůj digitální život&lt;/h2&gt;  &lt;p&gt;Zabezpečená vnější kapsa snadno pojme veškeré příslušenství a zároveň je oddělí od notebooku. Do brašny se vejde nabíječka, adaptér, myš, kabely, ale i předměty každodenní potřeby, jako jsou telefon, peněženka, karty a psací potřeby. Díky promyšlené vnitřní organizaci budete mít vše po ruce.&lt;/p&gt;  &lt;h2&gt;Seznam kompatibilních zařízení&lt;/h2&gt;  &lt;p&gt;13' MacBook Air s Retina displejem (A1932)&lt;br /&gt;13' MacBook Pro s USB-C (A2159, A1989, A1706, A1708)&lt;br /&gt;12,3' Surface Pro X / 7 / 6 / 5 / 4 / 3 / 2 / 1&lt;br /&gt;12,9' iPad Pro 3. gen (A1876, A2014, A1895)&lt;br /&gt;13' Dell XPS&lt;br /&gt;HP Chromebook 11 / Stream Notebook 11 / HP ENVY x2 12 / Pavilion x360 11&lt;br /&gt;Dell Chromebook 11 / Inspiron 11 3000 (touch)&lt;br /&gt;Acer Chromebook 11 / Chromebook R11&lt;br /&gt;Asus Chromebook C202SA / VivoBook S13 13 / VivoBook Flip 12 11.6&lt;br /&gt;Thinkpad X240 / X250 / X260 / X270 / X280&lt;br /&gt;HUAWEI MateBook 13 / X Pro&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1108.00","KS","0.00","5","2022-07-19T08:34:42.1","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625601_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625601_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625601_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625601_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625601_0e_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10605</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13919</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>44531</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19598</valuecode>        </productnavigatordata>      ","