"","false",""),("1625606","1894048","tomtoc Briefcase – 14' MacBook Pro (2021), černá","1257.00","1257.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","1257.00","1397.00","21.00","TOM-A14-C02H","false","0,00","Novinka","NoName","42029180","6970412222892","tomtoc Briefcase – 14' MacBook Pro (2021), černá","Barva:Černá; Typ:Taška; Úhlopříčka obrazovky:14'; Materiál:rPET","1","&lt;h1&gt;tomtoc Briefcase – 14' MacBook Pro (2021), černá&lt;/h1&gt;  &lt;p&gt;Udržitelnost a ekologická nenáročnost je v současné době jednou z nejpalčivějších průmyslových otázek. Společnost Tomtoc k naší planetě není lhostejná a pro vývoj univerzální brašny A14 pro 14.2“ MacBook Pro využívá alternativního materiálu recyklovaných PET lahví.&lt;/p&gt;  &lt;p&gt;Kromě udržitelnosti však společnost vsází na vysokou ochranu přenášeného zařízení, precizní designérské zpracování a uživatelskou přívětivost. Kromě hlavní kapsy na notebook nebo tablet brašna nabízí dostatek prostoru pro příslušenství i osobní potřeby. Několik dalších přihrádek a popruhů v prostorné přední kapse zajistí dokonalý pořádek a organizaci. Černá minimalistická brašna je nenápadná a díky nadčasovému designu padne k obleku i volnočasovému outfitu.&lt;/p&gt;  &lt;p&gt;Společnost Tomtoc dbá především na bezpečí přenášeného zařízení. Spodní rohy brašny jsou pevně vyztuženy a při pádu tak brašna funguje jako airbag pro váš notebook či tablet. Vnitřek hlavní kapsy je podšit pevnou, avšak jemnou flísovou vrstvou a kolem zipů YKK je lem flísu, aby nedošlo k poškrábání zařízení. I přes kvalitu použitých materiálů a komponentů taška zůstává lehká a díky měkké rukojeti z veganské kůže je vhodná i pro nošení na delší vzdálenosti.&lt;/p&gt;  &lt;p&gt;• Využití 100% recyklovaných PET lahví na vrchní vrstvu brašny&lt;br /&gt;• Kvalitní materiály&lt;br /&gt;• Dokonalá ochrana&lt;br /&gt;• Uživatelská přívětivost&lt;br /&gt;• R Praktická organizace kapes&lt;br /&gt;• Kompatibilní se zařízeními velikosti 14.2 palců a menší&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Udržitelnost především&lt;/strong&gt;&lt;br /&gt;V současné době hledání nejrůznějších ekologických alternativ v průmyslovém designu je třeba přemýšlet udržitelně. Společnost Tomtoc se proto rozhodla vydat trochu jiným směrem a k výrobě brašny A14 využít materiálu ze 100% recyklovaných PET lahví. Materiál je ekologický a zároveň vykazuje skvělé vlastnosti jako pevnost, nepropustnost a snadnou údržbu.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Ochrana vašeho notebooku&lt;/strong&gt;&lt;br /&gt;Vývojářský tým společnosti Tomtoc pracuje na brašnách, které vašemu zařízení dovedou poskytnout tu největší ochranu. Proto jsou dolní rohy brašny opatřeny pevnou výztuhou, která při jejím pádu či nárazu funguje podobně jako airbag při autonehodě. Vnitřní ochranu před poškrábáním pak zajišťuje hebká, měkká flísová podšívka a flísový lem kolem zipů. Vnější plášť brašny odolá dešti a o vaše zařízení je tak dokonale postaráno.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Vytříbenost tvaru a organizace&lt;/strong&gt;&lt;br /&gt;Brašna Tomtoc A14 kombinuje současné trendy s nadčasovým minimalistickým designem. Zavazadlo tak skvěle doplní elegantní oblek i džíny s mikinou. Brašna je navržena tak, aby se do ní vešlo vše, co během dne budete potřebovat. Prostorná přední kapsa nabízí dostatek místa pro příslušenství i další potřeby a díky vnitřnímu členění na přihrádky a popruhy si ve věcech najdete organizovaný systém. Sama o sobě je brašna velmi lehká a měkká rukojeť z veganské kůže vám zajistí pohodlné nošení i na delší vzdálenosti.&lt;/p&gt;  &lt;h2&gt;Shrnutí vlastností&lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;Vysoká kvalita materiálu&lt;/li&gt;  &lt;li&gt;Využití 100% recyklovaných PET lahví na vrchní plášť brašny&lt;/li&gt;  &lt;li&gt;Promyšlený organizační systém přední kapsy&lt;/li&gt;  &lt;li&gt;Nadčasový design&lt;/li&gt;  &lt;li&gt;Dokonalá ochrana&lt;/li&gt;  &lt;li&gt;Pohodlné užívání&lt;/li&gt;  &lt;li&gt;Dlouhá životnost&lt;/li&gt;  &lt;/ul&gt;  &lt;h2&gt;Kompatibilní se zařízeními&lt;/h2&gt;  &lt;p&gt;Vnitřní prostor - 12.80' x 9.14” x 0.67”,&lt;br /&gt;Vnější prostor - 13.8' x 10.2' x 1.26'&lt;br /&gt;13.5“ Microsoft Surface notebooky 4/3/2/1&lt;br /&gt;13.5“ Microsoft Surface Book 3/2/11&lt;br /&gt;3“ Old MacBook Air (A1466 A1369) | MacBook Pro Retina (A1502 A1425)&lt;br /&gt;12.9“ iPad Pro (1st/2nd Gen)&lt;br /&gt;Dell Inspiron 13 5000 | 13 7000&lt;br /&gt;Latitude 13 3000 2-in-1HP ENVY 13 | Spectre x360 13 | Chromebook x360 14&lt;br /&gt;Pavilion x360 14Acer Swift 1 | Swift 3 | Spin 1 | Spin 5 | Spin 7&lt;br /&gt;Asus VivoBook 14' | 13' | Flip 13.3' | Flip S 13.3' | S 13.3' | S13&lt;br /&gt;13.9'ThinkPad X1 Carbon (5th/6th/7th/8th/9th Gen)&lt;br /&gt;X390 Yoga | X380 Yoga | L390 Yoga&lt;br /&gt;A285Huawei Matebook 13 | D14&lt;br /&gt;X ProJumper EZbook X3&lt;br /&gt;13.3.“ What's in the Box: 1 x 13.5“ notebook Sleeve&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1257.00","KS","0.00","3","2022-07-14T14:44:50.503","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625606_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625606_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625606_0c_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>9383</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19602</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>quantityp>quantity          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1625607","1894049","tomtoc Briefcase – 16' MacBook Pro (2021), černá","1331.00","1331.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","1331.00","1479.00","21.00","TOM-A14-E02H","false","0,00","Novinka","NoName","42029180","6970412222915","tomtoc Briefcase – 16' MacBook Pro (2021), černá","Barva:Černá; Typ:Taška; Úhlopříčka obrazovky:16'; Materiál:rPET","1","&lt;h1&gt;tomtoc Briefcase – 16' MacBook Pro (2021), černá&lt;/h1&gt;  &lt;p&gt;Do detailu propracovaný design, využití kvalitních materiálů a vysoká ochrana pro váš notebook či tablet – to je univerzální brašna Tomtoc pro 16“ MacBook Pro. Dopřejte sobě i svému zařízení pořádný luxus.&lt;/p&gt;  &lt;p&gt;Univerzální brašna Tomtoc je sice dimenzována pro 16“ MacBook Pro, vyhovuje však většině zařízení o velikosti 16 palců a méně. Díky nenápadné černé barvě a nadčasovému designu padne k obleku i volnočasovému outfitu. Kromě velké kapsy na notebook obsahuje prostornou přední kapsu s propracovaným členěním pro uložení veškerého příslušenství i osobních potřeb.&lt;/p&gt;  &lt;p&gt;Univerzální brašna Tomtoc A14 nabízí opravdu vysokou ochranu přenášeného zařízení. Spodní rohy jsou pevně vyztuženy pro případ nárazu či pádu a vnitřek kapsy je podšit silnou, avšak jemnou flísovou vrstvou, aby se zařízení nepoškrábalo. Inteligentní řešení bočního otevírání hlavní kapsy vám pomůže notebook ochránit před krádeží v přeplněných dopravních prostředcích a vrchní tkanina v deštivých dnech nepropustí ani kapku. I přes vysokou kvalitu materiálů je brašna lehká a díky měkké rukojeti z veganské kůže se skvěle nosí i při delších vzdálenostech.&lt;/p&gt;  &lt;p&gt;• Kvalitní materiály&lt;br /&gt;• Bezpečné boční otevírání&lt;br /&gt;• Praktická organizace kapes&lt;br /&gt;• Dokonalá ochrana&lt;br /&gt;• Uživatelská přívětivost&lt;br /&gt;• Kompatibilní se zařízeními velikosti 16 palců a menší&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Bezpečí pro váš notebook&lt;/strong&gt;&lt;br /&gt;Společnost Tomtoc ví, že brašna na notebook by především měla plnit funkci ochrany přenášeného zařízení. Nic neponechala náhodě a spodní rohy brašny pevně vyztužila, aby ani při prudkých nárazech a pádech z větší výšky nedošlo k jeho poškození. Vnitřek kapsy je po všech stranách podšit měkkou flísovou vložkou a zip obepíná zvýšený flísový límec, který brání před jakýmkoli poškrábáním zařízení. Při cestách v přeplněných dopravních prostředcích oceníte boční rozepínání, které znesnadní odcizení při potenciálním pokusu o krádež.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Promyšlenost tvaru&lt;/strong&gt;&lt;br /&gt;Jak už sám název produktu napovídá, tento model brašny Tomtoc vsází na nenápadnost a univerzalitu, aniž by porušil zásady současných designérských trendů. Brašna tak skvěle padne k obleku a naleštěným botám i k džínům s mikinou. Kromě přenášení notebooku navíc umožní uložení všeho potřebného příslušenství a osobních věcí jako brýle, peněženka či poznámkový blok. Prostorná přední kapsa nabízí propracovaný organizační systém a vy tak přesně víte, kde co hledat.&lt;/p&gt;  &lt;p&gt;&lt;strong&gt;Kvalita a pohodlí&lt;/strong&gt;&lt;br /&gt;I přes vysokou kvalitu použitého materiálu a využití pevných komponentů zůstává brašna velmi lehká a díky měkké rukojeti z veganské kůže se stane vaším dobrým pomocníkem i při cestách na delší vzdálenosti. Vše, co k běžnému dni potřebujete, se vám vejde do této jedné brašny a vy tak nemusíte nosit několik zavazadel. Pokud cestujete do zahraničí, jednoduše brašnu i s notebookem zasunete k ostatním věcem do kufru či jiného většího zavazadla.&lt;/p&gt;  &lt;h2&gt;Shrnutí vlastností&lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;Vysoká kvalita materiálu&lt;/li&gt;  &lt;li&gt;Bezpečné boční otevírání hlavní kapsy&lt;/li&gt;  &lt;li&gt;Pohodlné nošení i na delší vzdálenosti&lt;/li&gt;  &lt;li&gt;Dokonalá ochrana&lt;/li&gt;  &lt;li&gt;Promyšlený organizační systém přední kapsy&lt;/li&gt;  &lt;li&gt;Nadčasový design&lt;/li&gt;  &lt;li&gt;Dlouhá životnost&lt;/li&gt;  &lt;/ul&gt;  &lt;h2&gt;Kompatibilní se zařízeními&lt;/h2&gt;  &lt;p&gt;Vnitřní rozměry - 14.13' x 9.87' x 0.64'&lt;br /&gt;Vnější rozměry - 15' x 10.8' x 1.26“&lt;br /&gt;16“ MacBook Pro 2019 | 15 inch MacBook Pro Retina (A1398)&lt;br /&gt;15“ Microsoft Surface Book 2&lt;br /&gt;Dell XPS 15&lt;br /&gt;ThinkPad X1 Extreme Gen 2 (15') Laptop&lt;br /&gt;HP Spectre x360 Laptop - 15t touch | ENVY x360 Laptop - 15t touch | Pavilion x360 – 15&lt;br /&gt;Lenovo IdeaPad 500 Series S540 (15”)&lt;br /&gt;HUAWEI MateBook D 15.6”&lt;br /&gt;ASUS Zenbook 15 | VivoBook 15&lt;br /&gt;Acer Swift 5 SF515&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1331.00","KS","0.00","3","2022-07-14T14:49:41.52","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625607_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625607_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625607_0c_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10575</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>8714</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19602</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>quantityp>quantity          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1625608","1894050","tomtoc Smart Messenger – 13' MacBook Pro / Air (2016+), šedá","1257.00","1257.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","1257.00","1397.00","21.00","TOM-A25-C02G","false","0,00","Novinka","NoName","42029180","6971937061553","tomtoc Smart Messenger – 13' MacBook Pro / Air (2016+), šedá","Barva:Šedá; Typ:Taška; Úhlopříčka obrazovky:13'; Materiál:Polyester","1","&lt;h1&gt;tomtoc Smart Messenger – 13' MacBook Pro / Air (2016+), šedá&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;&lt;strong&gt;Tomtoc Smart Briefcase je šitý na míru potřebám uživatelů MacBooků, kteří ho využívají jako plnohodnotný pracovní nástroj. Do obalu se totiž vejde i veškeré příslušenství, včetně nabíječky, kabelů nebo tabletu.&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Vedle usnadnění používání iPadu na cestách je hlavním úkolem tomtoc obalu udržet notebook v bezpečí při nárazech nebo před rozlitými tekutinami. Vnější pevná skořepina chrání MacBook před nárazy a jeho povrch je navíc chráněný měkkou vnitřní vložkou proti poškrábání.&lt;/p&gt;  &lt;p&gt;• Brašna na 13'' MacBook Pro / Air (2016+)&lt;br /&gt;• Skořepinová konstrukce s vyztuženými rohy&lt;br /&gt;• Povrch odolný proti rozlitým tekutinám&lt;br /&gt;• Vnitřní a vnější kapsy na příslušenství&lt;br /&gt;• Nastavitelný popruh, 2 madla&lt;br /&gt;• Max. velikost notebooku: 30,4 x 21,2 cm&lt;/p&gt;  &lt;h2&gt;Uspořádejte si svůj digitální život&lt;/h2&gt;  &lt;p&gt;Integrovaný ramenní popruh a 2 vyztužená madla usnadňují přenášení i vkládání MacBooku. Do velké vnitřní kapsy pohodlně naskládáte dokumenty nebo tablet. Dvě prostorné vnější kapsy jsou ideální na napájecí adaptér, kabely, huby a další příslušenství, které pak nepřekáží uvnitř. Ušetříte si tak zbytečné nošení několika tašek&lt;/p&gt;  &lt;h2&gt;Vnitřní výztuhy ochrání rohy notebooku&lt;/h2&gt;  &lt;p&gt;Zesílené hrany a vyztužené rohy jsou součástí 360° ochrany vloženého zařízení. Pevné nárazuvzdorné chrániče jsou umístěné na rozích, které jsou při pádech vystavené největším otřesům. Notebook tak zůstane v bezpečí, i když vám omylem v obalu vypadne z ruky.&lt;/p&gt;  &lt;h2&gt;Nedáte ho z ruky&lt;/h2&gt;  &lt;p&gt;Funkční design messengeru zahrnuje i vodoodpudivou tkaninu na povrchu, která ochrání zařízení uvnitř. Kvalitní zipy YKK jsou známé svým hladkým chodem a extra dlouhou výdrží. Pružné vnější kapsy pojmou veškeré příslušenství. Když jsou prázdné, nepřidávají messengeru žádný objem navíc.&lt;/p&gt;  &lt;h2&gt;Rozměry&lt;/h2&gt;  &lt;p&gt;Max. velikost notebooku: 30,4 x 21,2 cm&lt;br /&gt;Rozměry: 33,5' x 24,9 x 38,1 cm&lt;br /&gt;Vnitřní kapsa: 30,4 x 21,2 cm&lt;br /&gt;Vnější kapsy: 15,2 x 15,9 cm&lt;/p&gt;  &lt;h2&gt;Určeno pro&lt;/h2&gt;  &lt;p&gt;13' MacBook Air s Retina Display (A2179 A1932)&lt;br /&gt;13' MacBook Pro s USB-C (A2251 A2289 A2159 A1989 A1706 A1708)&lt;/p&gt;  &lt;h2&gt;Příklady dalších kompatibilních zařízení&lt;/h2&gt;  &lt;p&gt;Dell XPS 13&lt;br /&gt;Microsoft Surface Pro X/7/6/5/4/3/2/1&lt;br /&gt;Dell, Asus, Acer, Lenovo, Samsung 11.6' Chromebook&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1257.00","KS","0.00","8","2022-07-25T10:22:04.123","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625608_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625608_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625608_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625608_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625608_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625608_0f_3.jpg','6':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625608_0g_3.jpg','7':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625608_0h_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10608</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          