30,5 x 21 x 1,5 cm&lt;/p&gt;  &lt;h2&gt;Notebook zůstane jako nový&lt;/h2&gt;  &lt;p&gt;360° vnitřní ochrana zahrnuje bohatou výstelku z mikroplyše, která na všech místech kryje i zip tak, aby nedošlo k poškrábání šasí. Speciálně navržená rukojeť je vám k dispozici, když potřebujete brašnu pohodlně přenést, v opačném případě kopíruje čisté designové linky.&lt;/p&gt;  &lt;h2&gt;Vnitřní výztuhy ochrání rohy notebooku&lt;/h2&gt;  &lt;p&gt;Zesílené hrany a vyztužené rohy jsou součástí 360° ochrany vašeho zařízení. Plastové chrániče jsou umístěné na rozích, které jsou při pádech vystavené největším nárazům. Notebook tak zůstane v bezpečí, i když vám taška omylem vypadne z ruky.&lt;/p&gt;  &lt;h2&gt;Bezpečnější a pohodlnější používání&lt;/h2&gt;  &lt;p&gt;Samosvorné zipy jsou upravené tak, aby se při zapnutí zároveň 'uzamkly' a zabránily samovolnému otevření brašny. Notebook je chráněn před nechtěným vypadnutím a vy můžete využít bezpečný boční vstup, kam se zařízení snadněji vkládá. Design tomtocu si tím pádem vystačí s jediným prostorným uchem, které se snadno používá a samo se vtáhne, když jej nepotřebujete.&lt;/p&gt;  &lt;h2&gt;Polstrovaný ramenní popruh&lt;/h2&gt;  &lt;p&gt;Ramenní podložka z měkkého materiálu a plně nastavitelný odnímatelný popruh vám poskytnou pohodlí i při nošení těžkých zařízení. Rukojeť z kvalitní umělé kůže snadno uchopíte, protože je díky funkci samostatného zatažení dostatečně velká. Notebook tak bezpečně přenesete v ruce i na rameni.&lt;/p&gt;  &lt;h2&gt;Uspořádejte si svůj digitální život&lt;/h2&gt;  &lt;p&gt;Dvě zabezpečené vnější kapsy snadno pojmou veškeré příslušenství a zároveň je oddělí od notebooku. Do brašny se vejde nabíječka, adaptér, myš, kabely, ale i předměty každodenní potřeby, jako jsou telefon, peněženka, karty a psací potřeby. Díky promyšlené vnitřní organizaci kapes budete mít vše po ruce.&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1257.00","KS","0.00","8","2022