ošlo k poškrábání šasí. Speciálně navržená rukojeť je vám k dispozici, když potřebujete brašnu pohodlně přenést, v opačném případě kopíruje čisté designové linky.&lt;/p&gt;  &lt;h2&gt;Vnitřní výztuhy ochrání rohy notebooku&lt;/h2&gt;  &lt;p&gt;Zesílené hrany a vyztužené rohy jsou součástí 360° ochrany vašeho zařízení. Plastové chrániče jsou umístěné na rozích, které jsou při pádech vystavené největším nárazům. Notebook tak zůstane v bezpečí, i když vám taška omylem vypadne z ruky.&lt;/p&gt;  &lt;h2&gt;Bezpečnější a pohodlnější používání&lt;/h2&gt;  &lt;p&gt;Samosvorné zipy jsou upravené tak, aby se při zapnutí zároveň 'uzamkly' a zabránily samovolnému otevření brašny. Notebook je chráněn před nechtěným vypadnutím a vy můžete využít bezpečný boční vstup, kam se zařízení snadněji vkládá. Design tomtocu si tím pádem vystačí s jediným prostorným uchem, které se snadno používá a samo se vtáhne, když jej nepotřebujete.&lt;/p&gt;  &lt;h2&gt;Polstrovaný ramenní popruh&lt;/h2&gt;  &lt;p&gt;Ramenní podložka z měkkého materiálu a plně nastavitelný odnímatelný popruh vám poskytnou pohodlí i při nošení těžkých zařízení. Rukojeť z kvalitní umělé kůže snadno uchopíte, protože je díky funkci samostatného zatažení dostatečně velká. Notebook tak bezpečně přenesete v ruce i na rameni.&lt;/p&gt;  &lt;h2&gt;Uspořádejte si svůj digitální život&lt;/h2&gt;  &lt;p&gt;Dvě zabezpečené vnější kapsy snadno pojmou veškeré příslušenství a zároveň je oddělí od notebooku. Do brašny se vejde nabíječka, adaptér, myš, kabely, ale i předměty každodenní potřeby, jako jsou telefon, peněženka, karty a psací potřeby. Díky promyšlené vnitřní organizaci kapes budete mít vše po ruce.&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1257.00","KS","0.00","6","2022-07-20T10:22:49.303","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625611_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625611_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625611_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625611_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625611_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625611_0f_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10608</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>44531</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19598</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>quantityp>quantity          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1625612","1894054","tomtoc Shoulder Bag - 16'' MacBook Pro 2019, šedá","1703.00","1703.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","1703.00","1893.00","21.00","TOM-A50-E01G","false","0,00","Novinka","NoName","42029180","6971937060907","tomtoc Shoulder Bag - 16'' MacBook Pro 2019, šedá","Barva:Šedá; Typ:Taška; Úhlopříčka obrazovky:16', 16'; Materiál:Polyester","1","&lt;h1&gt;tomtoc Shoulder Bag – 16'' MacBook Pro 2019, šedá&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;&lt;strong&gt;Pro každodenní přenos z domu do práce a zpátky, na pracovní cesty i jako příruční zavazadlo na dovolenou. Moderní polstrovaná taška tomtoc Casual A50 chrání Váš MacBook před nepříznivými vnějšími vlivy i mechanickým poškozením.&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;O tom, že se model Casual A50 řadí mezi top designové kousky, asi nemusíme polemizovat. Tím ale součet výhod rozhodně nekončí. Polstrovaný popruh přes rameno je maximálně pohodlný a snadno nastavitelný. Vnitřní uspořádání společně s extra kapsou na zip umožňuje snadnou organizaci.&lt;/p&gt;  &lt;p&gt;Při přenášení MacBooku nám jde především o maximální bezpečnost a ochranu zařízení. O tu se stará vodoodpudivá membrána a ultra polstrování ve spodní části brašny.&lt;/p&gt;  &lt;p&gt;• Obal na Macbook do velikosti 16'&lt;br /&gt;• Snadná organizace díky vnitřnímu členění&lt;br /&gt;• Vnější kapsa na příslušenství&lt;br /&gt;• Vodoodpudivá membrána&lt;br /&gt;• Měkký polstrovaný interiér s extra ochranou&lt;/p&gt;  &lt;h2&gt;Do práce i do letadla&lt;/h2&gt;  &lt;p&gt;Brašna tomtoc Casual A50 je určená pro aktivní podnikatele i nadšené cestovatele a je zcela přizpůsobena aktivnímu životnímu stylu. Díky modernímu provedení ji lze snadno zkombinovat s oblekem i volnočasovým oblečením. Nastavitelný ramenní popruh s polstrováním umožňuje komfortní nošení. Zadní strana je obohacena o široký pás pro připevnění tašky k cestovnímu kufru.&lt;/p&gt;  &lt;h2&gt;Ochrana MacBooku na prvním místě&lt;/h2&gt;  &lt;p&gt;Při každodenním přenášení MacBooku je nezbytná jeho spolehlivá ochrana. Taška Casual A50 má proto ve své spodní části extra polstrování v podobě měkké podšívky, která zajišťuje ultra protekci před nárazy i poškrábáním.&lt;/p&gt;  &lt;p&gt;Před nepříznivými vlivy počasí i rozlitou omylem rozlitou kávou chrání vodoodpudivá membrána doplněná o kvalitní spolehlivé japonské YKK zipy, které nepropustí ani kapku vody.&lt;/p&gt;  &lt;h2&gt;Vše po ruce díky pečlivé organizaci&lt;/h2&gt;  &lt;p&gt;Hlavní kapsa je rozdělená do několika oddílů, což značně usnadňuje organizaci. Polstrovaná kapsa s páskem na suchý zip pojme notebook do velikosti až 16', do menší kapsy snadno přidáte například tablet nebo čtečku knih. V prostřední kapse stále zůstane dostatek prostoru pro potřebné dokumenty.&lt;/p&gt;  &lt;p&gt;Příslušenství můžete uložit do samostatné prostorné vnější kapsy na zip. Ta je ještě navíc rozdělena do několika menších přihrádek, tak, aby umožnila snadný přístup ke všem nezbytnostem v ní uložených. Do samostatné kapsy se pohodlně vejde například adaptér s kabelem, myš nebo hub.&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1703.00","KS","0.00","5","2022-07-20T11:34:44","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625612_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625612_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625612_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625612_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625612_0e_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10608</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>8714</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>8714</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19598</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>quantityp>quantity          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1625613","1894055","tomtoc Urban Shoulderbag – 14' MacBook Pro (2021), šedá","1710.00","1710.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","1710.00","1900.00","21.00","TOM-H14-C01G","false","0,00","Novinka","NoName","42029180","6971937061454","tomtoc Urban Shoulderbag – 14' MacBook Pro (2021), šedá","Barva:Šedá; Typ:Taška; Úhlopříčka obrazovky:14'; Materiál:Polyester","1","&lt;h1&gt;tomtoc Urban Shoulderbag – 14' MacBook Pro (2021), šedá&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;&lt;strong&gt;Stylová šedá brašna Tomtoc Urban H14 pro 14.2“ MacBook Pro spojuje precizní designérské zpracování, praktičnost a vysokou ochranu vašeho digitálního zařízení. Ať už přecházíte z kanceláře do kavárny, jedete metrem nebo letíte na zahraniční pracovní cestu, tato brašna se stane vaším dobrým parťákem.&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Ačkoli je brašna dimenzována pro rozměry 14.2“ MacBooku Pro, je zcela kompatibilní s dalšími notebooky a tablety s úhlopříčkou 14,2 palců a méně. Hlavní kapsu na notebook doplňuje prakticky organizovaná velká přední kapsa, do které se vejde veškeré potřebné příslušenství a další pracovní a osobní potřeby. Brašna je velmi lehká a díky měkké rukojeti z veganské kůže či dlouhému popruhu přes rameno vyhovuje i přenášení na delší vzdálenosti.&lt;/p&gt;  &lt;p&gt;Vysoká ochrana přenášeného zařízení pro společnost Tomtoc představuje zásadní vlastnost jejich produktů. Spodní rohy brašny obsahují pevnou výztuhu a fungují tak jako airbag při nečekaných pádech či nárazech. Vnitřní kapsa na notebook je po všech stranách vystlána pěnovou 3D podšívkou a límec kolem vysoce kvalitních zipů YKK je potažen měkkým flísem. Pevná vnější tkanina je odolná proti polití a taška vydrží dlouhá léta jako nová.&lt;/p&gt;  &lt;p&gt;• Vysoká ochrana vašeho notebooku&lt;br /&gt;• Stylový design&lt;br /&gt;• Prakticky organizovaná přední kapsa&lt;br /&gt;• 3D pěnová vystýlka&lt;br /&gt;• Rukojeť z veganské kůže&lt;br /&gt;• Kvalitní komponenty&lt;/p&gt;  &lt;h2&gt;Dotaženost tvaru&lt;/h2&gt;  &lt;p&gt;Designérský tým společnosti Tomtoc kombinuje aktuální trendy s nadčasovým tvarem a barevností. Brašna Tomtoc H14 se tak skvěle hodí k obleku i volnočasovému outfitu a díky vnější vysoce odolné tkanině vydrží dlouhá léta jako nová. I přes vysoce kvalitní použité materiály a komponenty zůstává lehká a skvěle poslouží při každodenní chůzi do práce nebo jako doprovod na dlouhých zahraničních cestách.&lt;/p&gt;  &lt;h2&gt;Notebook v dokonalém bezpečí&lt;/h2&gt;  &lt;p&gt;Brašna Tomtoc H14 poskytuje vašemu zařízení precizní ochranu ve všech nenadálých situacích. V dolních rozích má umístěny pevné výztuhy, které při pádu či nárazu fungují jako airbag při dopravní nehodě. Vnitřní kapsa na notebook je po všech stranách vystlána pružnou, avšak měkkou 3D pěnou a kolem zipů YKK je natažen zvýšený flísový límec. Přenášené zařízení je dokonale chráněno po celém obvodu. Pevná povrchová tkanina nepropustí déšť ani rozlitý drink a v případě takové nehody ho jednoduše utřete suchým hadrem.&lt;/p&gt;  &lt;h2&gt;Organizace pro každý den&lt;/h2&gt;  &lt;p&gt;Praktická organizace vnitřního prostoru je u brašny na každodenní nošení velkou výzvou. Prostorná přední kapsa brašny Tomtoc poskytuje dostatek místa rozčleněného menšími přihrádkami, které skvěle poslouží jako organizér příslušenství k notebooku i běžným věcem každodenního použití jako jsou brýle, peněženka, Kindle, diář či poznámkový blok. Do brašny se vejdou všechny potřebné věci a vy tak do práce můžete vyrazit pouze s tímto jedním zavazadlem.&lt;/p&gt;  &lt;h2&gt;Shrnutí vlastností&lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;Vysoká kvalita materiálu&lt;/li&gt;  &lt;li&gt;Nadčasový design&lt;/li&gt;  &lt;li&gt;Dokonalá ochrana&lt;/li&gt;  &lt;li&gt;Promyšlený organizační systém přední kapsy&lt;/li&gt;  &lt;li&gt;Pohodlné užívání&lt;/li&gt;  &lt;li&gt;Dlouhá životnost&lt;/li&gt;  &lt;/ul&gt;  &lt;h2&gt;Kompatibilní se zařízeními&lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;Kompatibilní velikost notebooků a tabletů: 12.80' x 9.14' x 0.9'&lt;/li&gt;  &lt;li&gt;Kompatibilní s většinou 13“, až 13.3“ vybavením&lt;/li&gt;  &lt;li&gt;13“ MacBook Air&lt;/li&gt;  &lt;li&gt;13“ MacBook Pro&lt;/li&gt;  &lt;li&gt;12.9“ iPad Pro&lt;/li&gt;  &lt;li&gt;Surface Book 3/2/1&lt;/li&gt;  &lt;li&gt;Surface notebooky 3/2/1&lt;/li&gt;  &lt;li&gt;Dell HP Acer Asus Lenovo HUAWEI 13“ notebooky&lt;/li&gt;  &lt;/ul&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1710.00","KS","0.00","3","2022-07-25T10:24:27.363","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625613_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625613_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625613_0c_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10608</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13915</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>9383</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19598</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>quantityp>quantity          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1625614","1894056","tomtoc Premium Sleeve – 16'' MacBook Pro 2019, šedá, koňaková","1561.00","1561.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","1561.00","1735.00","21.00","TOM-H15-E01Y","false","0,00","Novinka","NoName","42029180","6971937061157","tomtoc Premium Sleeve – 16'' MacBook Pro 2019, šedá, koňaková","Barva:Šedá, Hnědá; Typ:Pouzdro; Úhlopříčka obrazovky:16'; Materiál:Polyester, Kůže","1","&lt;h1&gt;tomtoc Premium Sleeve – 16'' MacBook Pro 2019, šedá, koňaková&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;&lt;strong&gt;Elegantní sleeve od značky tomtoc určený na 16' MacBook Pro (2019) vám nesmí chybět. Jednoduché tvary a elegantní design doplní váš osobitý styl a zároveň spolehlivě ochrání vložené zařízení.&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Před nepříznivými vlivy vnějšího prostředí MacBook ochrání 2 vrstvy funkčních materiálů. Vnitřní zpevněný rám vstřebá otřesy a nárazy vznikající při přenášení a bariéru rozlitým tekutinám tvoří vnější odolný 600D polyester.&lt;/p&gt;  &lt;p&gt;Jednoduché výrazné linie a kontrastní barvy a materiály podtrhnou váš jedinečný styl. Magnetická klopa a boky z koňakové umělé kůže kontrastují s šedým melírem a dělají z obalu výrazný doplněk.&lt;/p&gt;  &lt;p&gt;• Obal na 16' MacBook Pro 2019 (A2141) a 15' Dell XPS&lt;br /&gt;• 2 ochranné vrstvy&lt;br /&gt;• Pevná struktura&lt;br /&gt;• Klopa na magnet&lt;br /&gt;• Kapsa skrytá pod klopou&lt;/p&gt;  &lt;h2&gt;Navržený pro každodenní používání&lt;/h2&gt;  &lt;p&gt;Jedinečný design obalu využívá strohé linie, díky kterým vyniknou kontrastní materiály a výrazné tvarování. Bez přečnívajících kapes, zipů a zapínání se s obalem snadno manipuluje, zvlášť pokud jej potřebujete vložit do další tašky. Soudržnost obalu a snadné používání umocňuje magnetické zavírání na klopě.&lt;/p&gt;  &lt;h2&gt;Dvojitá ochrana MacBooku&lt;/h2&gt;  &lt;p&gt;Rohy obalu jsou vybavené zesílenými ochrannými lištami, které chrání vaše zařízení před náhodnými nárazy a otřesy. Povrchová polyesterová tkanina 600D se používá na namáhané části zavazadel, je odolná proti oděru a rozlitým kapalinám, takže vytváří bariéru před vlivy každodenního používání.&lt;/p&gt;  &lt;h2&gt;Elegantní retro styl&lt;/h2&gt;  &lt;p&gt;Výraznou koňakovou umělou kůži na klopě a po stranách obalu doplňuje melírovaná šedá polyesterová tkanina na pevném ochranném rámu. Hrubší struktura látky, pevný rám a čisté tvary vám poskytnou jistý úchop a podpoří váš jedinečný styl.&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1561.00","KS","0.00","6","2022-07-20T10:53:26.903","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625614_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625614_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625614_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625614_0d_3.jpg','4':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625614_0e_3.jpg','5':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625614_0f_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>10608</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>11385</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13918</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>8714</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19598</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19595</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>quantityp>quantity          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1625615","1894057","tomtoc case na 13' Macbook Air/Pro, šedá/hnědá","1108.00","1108.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","1108.00","1231.00","21.00","TOM-H16-C02Y","false","0,00","Novinka","NoName","42029180","6971937063175","tomtoc case na 13' Macbook Air/Pro, šedá/hnědá","Barva:Hnědá, Hnědá; Typ:Pouzdro; Úhlopříčka obrazovky:13'; Materiál:Kůže, Bavlna","1","&lt;h2 style='color:#e21b52;border-bottom:1px solid #eaecf5;margin-bottom:10px;font-size:1.42rem;font-weight:500'&gt;tomtoc – case na 13' Macbook Air/Pro, šedá/hnědá&lt;/h2&gt;&lt;div style='flex-flow: row wrap; display: flex;'&gt;&lt;div style='padding: 10px; flex: 1 1 40%;'&gt;V jednoduchosti je síla. Sleeve tomtoc poskytuje spolehlivou ochranu až 13palcového Macbooku a zároveň skvěle vypadá. Ultra tenký design výborně podtrhne váš styl. V případě potřeby obal snadno schováte do oblíbené kabelky nebo batohu, ale nic vám nebrání nosit case samostatně. Kombinace hladké plsti a kůže působí elegantním dojmem a skvěle doplní formální i neformální outfit.&lt;br&gt;    Macbook není levná záležitost, a proto si zaslouží náležitou ochranu. Univerzální sleeve tomtoc s vnitřní podšívkou z mikrovlákna jej ochrání před mechanickým poškozením při přenášení i před nežádoucím povrchovým poškrábáním.  &lt;br&gt;  Hlavní ultra tenká přihrádka je doplněná o vnější kapsu, do které pohodlně uložíte adaptér, nabíjecí kabel, myš a další příslušenství.&lt;br/&gt;&lt;br/&gt;• Obal na Macbook Air/Pro 13'&lt;br&gt;  • Vnější kapsa na příslušenství&lt;br&gt;  • Vnitřní polstrování z mikrovlákna&lt;br&gt;  • Ultra tenký design&lt;br&gt;  • Magnetická klopa&lt;br&gt;&lt;br/&gt;&lt;p style='margin:1.14rem 0;'&gt;&lt;span style='font-weight:500;'&gt;Zrozeni jeden pro druhého&lt;/span&gt;&lt;br/&gt;Case tomtoc a 13palcový Macbook Air/Pro tvoří výjimečnou dvojici. Macbook ideálně zapadne do hlavní přihrádky a je tak chráněný ze všech stran. Kvalitní vnitřní podšívka z mikrovlákna chrání zařízení před poškrábáním a jiným povrchovým poškozením.  Ultra tenký designový case poskytuje spolehlivou ochranu při přenášení. Umožňuje samostatné nošení – v tomto případě doplní váš elegantní outfit i neformální oblečení. Díky minimalistickému provedení je sleeve snadno přenosný a v případě potřeby jej pohodlně schováte do batohu i větší kabelky. Nespornou výhodou obalu je jeho výjimečně nízká hmotnost.&lt;/p&gt;&lt;p style='margin:1.14rem 0;'&gt;&lt;span style='font-weight:500;'&gt;Moderní design pro každou příležitost&lt;/span&gt;&lt;br/&gt;Obal na 13palcový notebook je vyrobený z kombinace hladké plsti a PU kůže. Působí tak velice elegantním moderním dojmem. Vrchní strana casu je opatřena magnetickou klopou, která umožňuje snadné a rychlé sbalení notebooku. Magnet je dostatečně silný, aby zabránil nežádoucímu samovolnému rozepnutí obalu a vyklouznutí Macbooku.  Po estetické stránce je klasická kombinace plsti v barvě uhlí a elegantní karamelové kůže sázkou na jistotu. V jednoduchosti je síla a pro tento case to platí dvojnásob.&lt;/p&gt;&lt;p style='margin:1.14rem 0;'&gt;&lt;span style='font-weight:500;'&gt;Snadné uspořádání&lt;/span&gt;&lt;br/&gt;Sleeve tomtoc disponuje hlavní přihrádkou na notebook a samostatnou vnější kapsou. Do té snadno uložíte veškeré příslušenství, jako je nabíječka, adaptér, USB kabely, myš a další. Vše je tak dokonale organizované a vždy po ruce. Rozměry kapsy jsou 6.61' x 10.12'.&lt;/p&gt;&lt;/div&gt;&lt;div style='margin-left:auto;margin-right:auto;padding:10px;vertical-align:top;box-sizing:border-box;'&gt;&lt;img style='margin:0;padding:0;width:auto;height:auto;vertical-align:middle;display:inline-block;visibility:visible;max-width:300px;box-sizing:border-box;' src=https://www.easystore.cz/pub/media/catalog/product/cache/3972a1996d0a428644de13491331b4c8/t/o/tomtoc_h16_1.jpg alt=''/&gt;&lt;/div&gt;&lt;/div&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","1108.00","KS","0.00","4","2022-07-19T08:37:49.267","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625615_0a_3.jpg','1':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625615_0b_3.jpg','2':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625615_0c_3.jpg','3':'https:\/\/c.edsystem.cz\/IMGCACHE\/_1625\/1625615_0d_3.jpg'}","        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>11385</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>823</attributecode>          <valuecode>11385</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1015</attributecode>          <valuecode>13918</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>184</attributecode>          <valuecode>44531</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19595</valuecode>        </productnavigatordata>        <productnavigatordata>          <attributecode>1331</attributecode>          <valuecode>19591</valuecode>        </productnavigatordata>      ","        <productlogisticdata>          <typ>quantityp>quantity          <count>1</count>          <weight>0</weight>          <length>0</length>          <width>0</width>          <height>0</height>        </productlogisticdata>      ","N","","false",""),("1625616","1894058","tomtoc Premium Briefcase – 14' MacBook Pro (2021), růžová","1636.00","1636.00","INE","0.00","0.00","0.000000","0.000","12 Měsíc(ů)","INTELIGENTNÍ ELEKTRONIKA","1636.00","1817.00","21.00","TOM-H21-C01C01","false","0,00","Novinka","NoName","42029180","6971937063984","tomtoc Premium Briefcase – 14' MacBook Pro (2021), růžová","Barva:Růžová; Typ:Taška; Úhlopříčka obrazovky:14'; Materiál:Polyester","1","&lt;h1&gt;tomtoc Premium Briefcase – 14' MacBook Pro (2021), růžová&lt;/h1&gt;  &lt;p&gt;&lt;em&gt;&lt;strong&gt;Vylaďte svůj pracovní den do dokonalosti. Pastelově růžová brašna Tomtoc H21 pro 14“ MacBook Pro vám zpříjemní a usnadní přenášení vašeho notebooku, ať už cestujete do práce nebo letíte na dovolenou.&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;  &lt;p&gt;Brašna Tomtoc nepřináší pouze precizní designérské zpracování. Kombinuje vysoce kvalitní materiály s kompaktností a dokonalou ochranou vašeho notebooku či tabletu. Kromě MacBooku Pro je kompatibilní s mnoha dalšími zařízeními s úhlopříčkou 14 palců a méně. Brašna nabízí vysoce promyšlený organizační systém sestávající ze čtyř prostorných kapes. Kapsy jsou podšity měkkým flísem, a kromě zařízení a příslušenství do nich můžete uložit nejrůznější každodenní potřeby jako sluneční brýle, kosmetiku či mobil.&lt;/p&gt;  &lt;p&gt;Bezpečnost je pro společnost Tomtoc zcela zásadní. Spodní rohy brašny obsahují pevnou výztuhu, která přenášené zařízení ochrání před nárazem v mnoha nebezpečných situacích. Vysoce kvalitní zipy YKK a integrované magnetické zapínání pak váš majetek pomůže ušetřit před ztrátou či krádeží. Pevné materiály a komponenty zajistí dlouhodobou životnost brašny a její malá váha a příjemná měkká rukojeť z veganské kůže zase pohodlné nošení i na delší vzdálenosti.&lt;/p&gt;  &lt;p&gt;• Vyztužené rohy&lt;br /&gt;• Promyšlený organizační systém&lt;br /&gt;• Kvalitní materiály&lt;br /&gt;• Elegance&lt;br /&gt;• Pohodlné nošení&lt;br /&gt;• Bezpečné zapínání&lt;/p&gt;  &lt;h2&gt;Vše na svém místě&lt;/h2&gt;  &lt;p&gt;Do detailu promyšlený organizační systém brašny Tomtoc vám usnadní každodenní cestování. Díky čtyřem prostorným kapsám nemusíte nosit další zavazadlo, a kromě zařízení a příslušenství se do nich vejdou i všechny další věci, které pro celý den v práci potřebujete. Přední prostorná kapsa poskytne dostatek prostoru pro osobní potřeby jako kosmetiku či sluneční a dioptrické brýle, zadní magnetická kapsa zase pro cennosti jako peněženku či mobilní telefon. Všechny kapsy jsou podšity hebkých flísem a zařízení je tak jako v peřince.&lt;/p&gt;  &lt;h2&gt;Precizní designérské zpracování&lt;/h2&gt;  &lt;p&gt;Elegantní brašna Tomtoc kombinuje současné trendy s nadčasovým designem a decentně tak doplňuje každý pracovní či volnočasový outfit. Pastelovou, světle růžovou barvu podtrhují promyšlené tvary a komponenty z veganské kůže. Taška je velmi lehká a díky dlouhému popruhu či měkké rukojeti je vhodná i pro delší cesty. Pokud se chystáte na zahraniční let či cestu s větším zavazadlem, brašnu Tomtoc jednoduše schováte do kufru k ostatním věcem.&lt;/p&gt;  &lt;h2&gt;Bezpečnost na prvním místě&lt;/h2&gt;  &lt;p&gt;Vývojářský tým společnosti Tomtoc pracuje s myšlenkou dokonalé ochrany v atraktivním balení. Proto využívá pouze vysoce kvalitní materiály a komponenty, které zajistí dlouhou životnost produktu i při každodenním nošení. Podstatným ochranným prvkem je vyztužení spodních rohů brašny, které poskytnou notebooku či tabletu bezpečí i při autonehodě či podobných nečekaných situacích. Zipy YKK a všité magnetické zapínání kapes pak poslouží jako praktická ochrana před ztrátou či loupeží.&lt;/p&gt;  &lt;h2&gt;Shrnutí vlastností&lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;Dokonalá ochrana&lt;/li&gt;  &lt;li&gt;Vytříbený design&lt;/li&gt;  &lt;li&gt;Promyšlený organizační systém kapes&lt;/li&gt;  &lt;li&gt;Pohodlné užívání&lt;/li&gt;  &lt;li&gt;Elegantní růžová barva&lt;/li&gt;  &lt;li&gt;Vysoká kvalita materiálu&lt;/li&gt;  &lt;/ul&gt;  &lt;h2&gt;Vhodné pro modely:&lt;/h2&gt;  &lt;ul&gt;  &lt;li&gt;14.2“ MacBook Pro 2021&lt;/li&gt;  &lt;li&gt;13.5-14.4“ Microsoft New Surface Laptop Studio 2021/4/3/2/1&lt;/li&gt;  &lt;li&gt;13.5“ Microsoft Surface Book 3/2/1&lt;/li&gt;  &lt;li&gt;13“ MacBook Air&lt;/li&gt;  &lt;li&gt;13“ MacBook Pro&lt;/li&gt;  &lt;li&gt;13“ Surface Pro 8 | X with Surface Pro X Keyboard or Signature Keyboard&lt;/li&gt;  &lt;li&gt;12.3“ Surface Pro 7+/7/6/5/4/3/2/1 with Type Cover&lt;/li&gt;  &lt;li&gt;Dell Inspiron 13 5000 | 13 7000 | Latitude 13 3000 2-in-1&lt;/li&gt;  &lt;li&gt;HP ENVY 13 | Spectre x360 13 | Chromebook x360 14 | Pavilion x360 14&lt;/li&gt;  &lt;li&gt;Acer Swift 1 | Swift 3 | Spin 1 | Spin 5 | Spin 7 | Chromebook R 13&lt;/li&gt;  &lt;li&gt;Asus ZenBook/VivoBook 14' | 13' | Flip 13.3' | Flip S 13.3' | S 13.3' | S13 13.9'&lt;/li&gt;  &lt;li&gt;ThinkPad X1 Carbon (5th/6th/7th/8th/9th Gen) | X390 Yoga | X380 Yoga | L390 Yoga | A285&lt;/li&gt;  &lt;li&gt;Huawei Matebook 13 | D14 | X Pro&lt;/li&gt;  &lt;li&gt;Jumper EZbook X3 13.3“&lt;/li&gt;  &lt;/ul&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-0