na zařízení a nezbytnosti v bezpečí a vždy na svém místě.&lt;/p&gt;  &lt;p&gt;Nylonová tkanina Codura je zvlášť odolná proti oděru a stříkající vodě. Kapsa na notebook je navíc vyztužená systémem CornerArmor, takže kromě šasí ochrání i vaše data při nárazech vznikajících při přenášení notebooku. Zip hlavní kapsy je vybavený průvlekem na zavazadlový zámek.&lt;/p&gt;  &lt;p&gt;• Městský batoh na až 16'' notebook&lt;br /&gt;• Nylonová tkanina Codura&lt;br /&gt;• Výztuhy rohů kapsy na notebook&lt;br /&gt;• Kvalitní zipy YKK s průvlekem na zámek&lt;br /&gt;• 1 vnější kapsa na zip&lt;br /&gt;• Objem: 15 L&lt;br /&gt;• Hmotnost: 650 g&lt;br /&gt;• Rozměry: 42 x 30 x 12 cm&lt;/p&gt;  &lt;h2&gt;Prostorný hlavní oddíl&lt;/h2&gt;  &lt;p&gt;Hlavní prostor batohu se samostatnou přihrádkou na notebook, tablet a příslušenství je díky jednoduchému elegantnímu designu prostorný a snadno přístupný. Vnější kapsa na další příslušenství a každodenní potřeby je vybavená užitečným popruhem s karabinou na klíče.&lt;/p&gt;  &lt;h2&gt;Dobře organizovaná kapsa&lt;/h2&gt;  &lt;p&gt;Do velké nenápadné přední kapsy s dalšími přihrádkami přehledně uspořádáte všechno příslušenství, jako například stylus, kabely, psací potřeby a poznámkové bloky. Všitý popruh s karabinou v kontrastní barvě je dostatečně dlouhý, takže klíče ani nemusíte při odemykání odepínat.&lt;/p&gt;  &lt;h2&gt;Ochrana rohů při nárazu&lt;/h2&gt;  &lt;p&gt;Patentovaný systém ochrany proti nárazu ve spodních rozích kapes na notebook a tablet nabízí komplexní ochranu vložených zařízení.&lt;/p&gt;  &lt;h2&gt;High-tech a bezpečnostní design&lt;/h2&gt;  &lt;p&gt;Díky uzamykatelnému zipu YKK na hlavní přihrádce batohu se vám nestane, že by se batoh náhodně otevřel, stejně tak bude jeho obsah lépe chráněný před nenechavými prsty.&lt;/p&gt;","false","1","","-1","-1","true","","-1","-1","true","12","Měsíc(ů)","","0001-01-01T00:00:00","2224.00","KS","0.00","8","2022-07-14T14:07:14.25","NON","405","true","0","{'0':'https:\/\/c.edsystem.cz\/I